  strAlbum3DThumb: null,
  strDescriptionEN: 'The Beatles is the ninth official album by the English rock group The Beatles, a double album released in 1968. It is also commonly known as "The White Album" as it has no graphics or text other than the band\'s name embossed (and, on the early LP and CD releases, a serial number) on its plain white sleeve.\n\nThe album was written and recorded during a period of turmoil for the group, after visiting the Maharishi Mahesh Yogi in India and having a particularly productive songwriting session in early 1968. Returning to the studio, the group recorded from May to October 1968, only to have conflict and dissent drive the group members apart. Ringo Starr quit the band for a brief time, leaving Paul McCartney to play drums on two tracks. Many of the songs were "solo" recordings, or at least by less than the full group, as each individual member began to explore his own talent.\n\nUpon release in November 1968, the album received largely positive reviews and reached number 1 on the charts in the United Kingdom and the United States. The album is notable for the eclectic nature of its songs, which has divided critics in evaluating its legacy. The album has sold over 30 million copies worldwide, and was listed at number 10 on Rolling Stone\'s "500 Greatest Albums of All Time" list. Previously in 1987, as part of their 20th anniversary, Rolling Stone ranked it #9 on "The 100 Best Albums of the Last Twenty Years."',
  strDescriptionDE: null,
  strDescriptionFR: "The Beatles, souvent surnomm l'album blanc ou le double blanc,  cause de sa pochette extrieure entirement blanche, est un double album des Beatles sorti le 22 novembre 1968 sous leur propre label, Apple Records, et contenant 30 chansons originales rparties sur quatre faces.\n\nL'album est un nouveau tournant musical dans la carrire des Beatles. Explor en long et en large depuis Revolver jusqu' Magical Mystery Tour, le psychdlisme laisse place  un retour vers le rock 'n' roll, des arrangements plus simples et des textes moins philosophiques. Les guitares acoustiques sont ainsi souvent prfres aux sonorits complexes de Sgt. Pepper, puisque c'est sur cet instrument qu'ont t crites la plupart des chansons, durant le sjour du groupe au nord de l'Inde,  Rishikesh dans l'ashram du Maharishi Mahesh Yogi.\n\nPaul McCartney s'affiche en brillant touche--tout, abordant une large palette de genres musicaux, George Harrison affirme ses talents d'auteur-compositeur, Ringo Starr compose sa premire chanson, tandis que John Lennon va de plus en plus loin dans l'introspection, fait parfois dans la drision, se montre aussi iconoclaste ou mordant, et surtout, chante son amour pour sa nouvelle me sur, Yoko Ono. La prsence de cette dernire dans les studios d'enregistrement est d'ailleurs un facteur de tensions.\n\nMalgr de nombreuses difficults, dues  une msentente croissante au sein du groupe durant sa ralisation, la formule de cet album double fonctionne, puisque le succs du disque est colossal. Ce sera la troisime meilleure vente d'album du groupe, aprs Sgt. Pepper et Abbey Road, et le plus vendu sur le territoire amricain, avec plus de 20 millions d'exemplaires couls. Il reste ainsi en tte des hit-parades pendant huit semaines au Royaume-Uni et neuf aux USA.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "The Beatles es el noveno lbum de estudio de la banda britnica de rock The Beatles, lanzado en noviembre de 1968 como un lbum doble. Comnmente es conocido como The White Album (El lbum Blanco), por su funda totalmente blanca ideada por el artista britnico Richard Hamilton, pionero del pop art. Fue la primera publicacin de la banda desde la muerte de su mnager Brian Epstein, y el primero publicado por su propio sello discogrfico, Apple Records. Originalmente se iba a llamar A Doll's House, pero una banda inglesa de rock progresivo llamada Family ya haba publicado un lbum titulado Music in a Doll's House a principios de 1968.\n\nLas canciones de The Beatles fueron en su mayora escritas y grabadas durante un periodo de turbulencias en el grupo. Despus de visitar al Maharishi Mahesh Yogi en la India y durante un periodo productivo de composiciones a principios de 1968, el grupo regres al estudio para grabar durante el mes de mayo hasta octubre de 1968.\n\nTras su lanzamiento en noviembre de 1968, el lbum ha recibido distintas crticas mixtas y alcanz el n 1 en el Reino Unido y Estados Unidos. En 2003, la revista musical Rolling Stone lo coloc en el puesto nmero 10 de su lista de los 500 mejores lbumes de todos los tiempos. Es uno de los seis lbumes certificados con disco de diamante de The Beatles, lo que los convierte en los mximos ganadores de este reconocimiento en la historia de la msica. Los otros lbumes con disco de diamante son The Beatles/1962-1966, The Beatles/1967-1970, Abbey Road, Sgt. Pepper's Lonely Hearts Club Band y 1.",
  strDescriptionPT: 'The Beatles  o dcimo lbum dos Beatles, lanado como disco duplo em 22 de novembro de 1968. Este lbum est na lista dos 200 lbuns definitivos no Rock and Roll Hall of Fame.\n\n popularmente conhecido como The White Album (O lbum Branco), por no haver nome, e ser apenas um fundo branco com o nome da banda em relevo. A capa foi criada pelo artista pop Richard Hamilton e o ttulo original era para ser A Dolls House, mas uma banda britnica chamada Family, j tinha lanado um lbum com nome similar. Foi o primeiro disco lanado aps a morte do manager Brian Epstein.\n\nEm 1997, O lbum Branco foi nomeado o dcimo melhor disco de todos os tempos pela "Music of the Millennium" da Classic FM. Em 1998 a Q Magazine colocou como 17 lugar e em 2000 em 7 lugar. A Rolling Stone colocou como o dcimo entre 500 lbuns e o canal VH1 como 11 lugar. De acordo com a Associao da Indstria de Discos da Amrica, o disco  19 vezes disco de platina e o dcimo disco mais vendido nos Estados Unidos.\n\nEm 2010, um colecionador argentino possua o lbum com assinaturas originais dos quatro beatles. A pea foi vendida na ocasio por 33 mil dlares.',
