  strAlbum3DFace: null,
  strAlbum3DThumb: null,
  strDescriptionEN: 'Help! is the title of the fifth British and tenth North American album by The Beatles, and the soundtrack from their film of the same name. Produced by George Martin for EMI\'s Parlophone Records, it contains fourteen songs in its original British form, of which seven appeared in the film. These songs took up the first side of the vinyl album and included the singles "Help!" and "Ticket to Ride". The second side contained seven other releases including the most-covered song ever written, "Yesterday".\n\nThe American release was a true soundtrack album, mixing the first seven songs with orchestral material from the film. Of the other seven songs that were on the British release, two were released on the US version of the next Beatles album, Rubber Soul, two were back-to-back on the next US single and then appeared on Yesterday and Today, and three had already been on Beatles VI.\nIn 2012, Help! was voted 331st on Rolling Stone magazine\'s list of the "500 Greatest Albums of All Time".',
  strDescriptionDE: null,
  strDescriptionFR: "Help! est le cinquime album des Beatles, paru le 6 aot 1965 au Royaume-Uni, et une semaine plus tard aux tats-Unis. Il est prpar dans le cadre d'un deuxime film les mettant en vedette, galement nomm Help!. Les Fab Four l'enregistrent au cours de plusieurs sessions rparties entre les concerts et les tournages, entre fvrier et juin 1965. Ils se tournent de plus en plus vers le travail en studio, y rptant directement les nouveaux titres en les enregistrant, multipliant les overdubs, approchant de nouveaux sons et de nouveaux instruments sur le chemin qui mne, plus tard dans l'anne,  Rubber Soul, tape majeure de leur carrire discographique.\n\nAvec cet album, les Beatles entrent de plain-pied dans la musique pop. La face A de Help! comprend les chansons composes pour le film, notamment la chanson ponyme et Ticket to Ride, parues en single. L'autre face contient pour sa part sept chansons absentes du long-mtrage, dont les deux dernires reprises officiellement mises en bote par le groupe, et Yesterday, enregistre par Paul McCartney, seul avec sa guitare et un quatuor  cordes, produisant un des plus grands succs de l'histoire de la musique.\n\nL'album connat un important succs critique et commercial, trnant neuf semaines en tte des hit-parades britanniques, aprs y tre entr directement  la premire place le jour de sa publication, avant de se maintenir 41 semaines dans les classements. La version publie aux tats-Unis, dsapprouve par les Beatles, est nettement diffrente ; elle ne comprend en effet que les chansons de la face A, intercales entre des morceaux instrumentaux issus du film. Les autres chansons de l'album britannique se retrouvent sur les albums amricains Beatles VI, Rubber Soul et Yesterday and Today. Les titres de Help! sont donc rpartis sur quatre disques, qui sont autant de no 1 sur le march amricain.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "Help! es el quinto lbum britnico de los Beatles, y el noveno americano, al tiempo que banda sonora de su pelcula de mismo ttulo. Producido por George Martin para el sello discogrfico subsidiario de EMI, Parlophone, el disco presentaba catorce canciones en su forma britnica original, de las cuales siete aparecieron en la pelcula Help!. Estas siete canciones ocuparon el primer lado del lbum de vinilo. El segundo lado contuvo otras siete canciones que inclua el tema ms versionado jams escrito, Yesterday.\n\nLa edicin americana se haba convertido en una verdadera banda sonora de pelcula, al mezclar las primeras siete canciones con material orquestal de la pelcula. De las otras siete canciones, dos se publicaran en la versin estadounidense del siguiente lbum de los Beatles, Rubber Soul; dos se editaran en un mismo disco sencillo americano, apareciendo despus en el lbum Yesterday and Today; y tres apareceran en Beatles VI.\n\nEn 2003, la revista Rolling Stone clasific Help! en el puesto 332 de su lista de los 500 mejores lbumes de todos los tiempos.",
  strDescriptionPT: 'Help!  o quinto lbum do grupo The Beatles, que teve tambm um lanamento simultneo de um filme com mesmo nome.\n\nLanado em agosto de 1965, no auge da beatlemania e das turns do grupo, o lbum reflete algumas mudanas na msica dos fab-four. Temos Lennon compondo ao estilo de Bob Dylan em "You\'ve Got To Hide Your Love Away", a candidez de Harrison em "I Need You". Alm do sucesso de "Ticket To Ride" e da msica "Help" o lbum ainda tm uma preciosidade: a msica "Yesterday", nada menos que a cano mais regravada na histria da msica.',
