  strAlbum3DFace: null,
  strAlbum3DThumb: null,
  strDescriptionEN: 'Something New is The Beatles\' third Capitol LP release, but fifth American album following the United Artists release of A Hard Day\'s Night. This album includes eight songs from the original British release of A Hard Day\'s Night, as well as the remaining tracks "Slow Down" and "Matchbox" from the Long Tall Sally EP and the German language version of "I Want to Hold Your Hand". It was released in mono and stereo, and all mono mixes of the five songs duplicated from the United Artists soundtrack album are the same. This was the first Capitol Beatles album with all of the tracks in "true" stereo. The mono release contains alternative versions of "Any Time At All" (a different mix during the instrumental bridge), "I\'ll Cry Instead" (the "missing" third verse), "When I Get Home" (the line "Till I walk out that door again" during the song\'s bridge has a different vocal passage from the UK mono mix), and "And I Love Her" (McCartney\'s non-double-tracked vocal).\n\nThe album spent nine weeks at #2 on the Billboard 200, behind the United Artists A Hard Day\'s Night album.\n\nThis album was also released on the Parlophone label for sale only on American Armed Forces bases in Europe. These copies have great collector value. The album was also issued in Germany on the Odeon label. The German stereo version contains a reprocessed stereo version of "Komm, Gib Mir Deine Hand" and an extended version of "And I Love Her", repeating the closing riff six times instead of four. This mix was later released on the US version of Rarities.\n\nIn 2004 this album was released for the first time on CD as part of The Capitol Albums, Volume 1 box set (catalogue number CDP 7243 8 66876 2 3).',
  strDescriptionDE: null,
  strDescriptionFR: "Something New est un album du groupe britannique The Beatles, le 5e publi aux tats-Unis. Ce disque ne contient que six pices indites car I'll Cry Instead, Tell Me Why, And I Love Her, I'm Happy Just to Dance with You et If I Fell avaient dj t publies un mois plus tt, par le label United Artists, sur la trame sonore du film A Hard Day's Night.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: 'Something New es un lbum de estudio de la banda britnica The Beatles publicado en Estados Unidos el 20 de julio de 1964. Fue el tercer disco editado por Capitol Records, pero el quinto lbum estadounidense publicado despus de la banda sonora de la pelcula A Hard Day\'s Night. Este disco inclua ocho canciones originales del lbum britnico A Hard Day\'s Night as como los temas "Slow Down" y "Matchbox", del EP Long Tall Sally, y la versin alemana de "I Want to Hold Your Hand", titulada "Komm, Gib Mir Deine Hand". El lanzamiento en mono contena las versiones alternativas de "Any Time at All", "I\'ll Cry Instead" (el tercer verso "perdido"), "When I Get Home" y "And I Love Her" (el solo vocal por McCartney grabado a una sola pista).\n\nEl lbum estuvo nueve semanas en el n 2 de Billboard, por detrs de la banda sonora de United Artists A Hard Day\'s Night.\n\nEste lbum fue lanzado tambin bajo la etiqueta de Parlophone para ser vendido exclusivamente a las Fuerzas Armadas Americanas estacionadas en Europa. Con el tiempo, estos lbumes llegaron a tener gran valor entre los coleccionistas de discos. Something New fue editado, asimismo, bajo etiqueta de Odeon en Alemania. La versin alemana contena la versin indita de "And I Love Her", que despus se publicara en la versin estadounidense del disco recopilatorio Rarities.\n\nEn 2004, este lbum fue lanzado por primera vez en CD en The Capitol Albums Vol. 1, que contena asimismo los discos Meet the Beatles!, The Beatles\' Second Album y Beatles \'65.',
