  strAlbum3DFace: null,
  strAlbum3DThumb: null,
  strDescriptionEN: "Revolver is the seventh studio album by the English rock band The Beatles, released on 5 August 1966 on the Parlophone label and produced by George Martin. Many of the tracks on Revolver are marked by an electric guitar-rock sound, in contrast with their previous LP, the folk rock inspired Rubber Soul (1965). In Britain, the fourteen tracks from Revolver were released to radio stations throughout July 1966, \"building anticipation for what would clearly be a radical new phase in the group's recording career\".\n\nIt reached number one on both the British chart and American chart and stayed at the top spot for seven weeks and six weeks, respectively. The album was remastered 9 September 2009 for the first time since its 1987 digital compact disc release. Placed at number 1 in the All-Time Top 1000 Albums and number 3 in the Rolling Stone magazine's list of the 500 greatest albums of all time, the album is often regarded as one of the greatest achievements in music history and one of The Beatles' greatest studio achievements.",
  strDescriptionDE: null,
  strDescriptionFR: "Revolver est le septime album des Beatles, paru le 5 aot 1966 au Royaume-Uni et trois jours plus tard aux tats-Unis, avec une liste de chansons lgrement diffrente. Enregistr sur une priode de trois mois, cet album est souvent considr comme un album majeur de leur carrire et l'un des plus influents de tous les temps par les critiques, figurant entre autres  la troisime place dans la liste des 500 plus grands albums de tous les temps du magazine Rolling Stone.\n\nDans la continuit de Rubber Soul, Revolver marque un tournant capital dans le style musical des Beatles. Dlaissant leur image de  bons garons , les Beatles marquent avec cet album le dbut de l're psychdlique. Leur crativit artistique explose alors et sera confirme avec l'album suivant, Sgt. Pepper's Lonely Hearts Club Band, en 1967.",
