  strDescriptionES: 'Revolver es el sptimo lbum de The Beatles, habindose lanzado a la venta el 5 de agosto de 1966. El lbum present varios nuevos desarrollos estilsticos que llegaran a ser ms pronunciados en discos posteriores. Logr llegar al nmero uno en la lista de xitos de Gran Bretaa.\n\nRevolver fue el disco que marc la carrera del grupo como psicodlica. Con grandes contrastes como "Taxman" (rock cido), "Tomorrow Never Knows" (rock psicodlico) y "Eleanor Rigby" (con un cuarteto de cuerdas). Revolver es citado frecuentemente como uno de los mejores lbumes de la historia de la msica pop. En 1997 fue seleccionado en el tercer puesto de los mejores lbumes de todos los tiempos en una votacin de Music of the Millennium dirigida en el Reino Unido por prestigiosos medios, como son HMV, Channel, The Guardian y Classic FM. En febrero de 1998 los lectores de la Q magazine colocaron al lbum en el segundo lugar,4 mientras que en el ao 2001, la cadena de televisin VH1 lo situ en el primer puesto de entre los mejores 100 lbumes de todos los tiempos. Revolver fue tambin votado como mejor lbum en el Virgin All Time Top 1,000 Albums. Una crtica de PopMatters describi el lbum como "[la obra] de la banda ms grande de la historia de la msica popular, cuyos miembros alcanzaron su punto ms alto a nivel musical en el tiempo exacto", mientras que la revista Ink Blot afirmaba que el lbum "se mantiene en la cumbre de la msica popular occidental".\n\nEn 2003, Rolling Stone lo coloc en el puesto 3 de su lista de los 500 mejores lbumes de todos los tiempos.',
  strDescriptionPT: 'Revolver  o stimo lbum do grupo de rock ingls The Beatles lanado em 5 de agosto de 1966, inicialmente no Reino Unido e em 8 de agosto nos EUA. Atingiu o primeiro lugar nas paradas de sucesso americana e inglesa. Este lbum est na lista dos 200 lbuns definitivos no Rock and Roll Hall of Fame.\n\nConsiderado ainda mais inovador do que seu antecessor (Rubber Soul, de 1965), Revolver marca a adeso oficial dos Beatles ao Psicodelismo. Passeia desde a msica oriental "Love You To", aos apelos vibrantes de "Got to Get You into My Life", da solido lgubre de "Eleanor Rigby", ao experimentalismo psicodlico de "Tomorrow Never Knows" e o ufanismo de "Yellow Submarine". Nesta, particularmente, a chave da nova "abertura": "Vamos vivendo uma bela vida/Achamos para tudo uma sada/Cu azul, mar verde e belo/Em nosso submarino amarelo". Com os Beatles, o mundo embarcaria no submarino amarelo da fantasia, pronto para viver toda a loucura dos ltimos anos da dcada.',
