  strDescriptionEN: 'Sgt. Pepper\'s Lonely Hearts Club Band is the eighth studio album by the English rock band The Beatles. Released on 1 June 1967 on the Parlophone label, and produced by George Martin, the album is widely regarded as one of the greatest of all time. Including songs such as "Lucy in the Sky with Diamonds" and "A Day in the Life", the LP was recorded over a 129-day period beginning in December 1966. During the Sgt. Pepper sessions, the band improved upon their production quality, and explored experimental recording techniques. Martin\'s innovative, and lavish production included the use of an orchestra. The songs on the album range from music hall, rock and roll, pop rock, and traditional Indian music. The album\'s cover idea was sketched by McCartney, and then designed and executed by English pop artists Peter Blake and Jann Haworth. It depicts the band posing in front of a collage of some of their favourite celebrities, and has been widely acclaimed and imitated.\n\nSgt. Pepper was a worldwide critical and commercial success, spending a total of 27 weeks at the top of the UK Album Chart and 15 weeks at number one on the US Billboard 200. A defining album in the emerging psychedelic rock style, the album was critically acclaimed upon release and won four Grammy Awards in 1968. It frequently ranks at or near the top of published lists of the greatest albums of all time. In 1994, it was ranked number one in the book All Time Top 1000 Albums. In 2003, and again in 2012, the album was placed at number one on Rolling Stone magazine\'s list of "The 500 Greatest Albums of All Time". Sgt. Pepper is one of the world\'s best selling albums; 32 million copies have been shipped',
  strDescriptionDE: null,
  strDescriptionFR: "Sgt. Pepper's Lonely Hearts Club Band est le huitime album des Beatles. Cet album est souvent cit comme leur plus grande uvre et l'un des albums les plus influents de tous les temps par les critiques, figurant entre autres  la premire place dans la liste des 500 plus grands albums de tous les temps du magazine Rolling Stone. Enregistr par les Beatles sur une priode de 129 jours, l'album est sorti le 1er juin 1967 en Grande-Bretagne et le jour suivant aux tats-Unis.\n\nPar son retentissement, par la faon dont il a rvolutionn l'industrie du disque, par sa dure de vie dans les hit-parades, par la force avec laquelle il a capt l'air de son temps  il fut la  bande sonore  du Summer of Love , Sgt. Pepper reste encore  ce jour une pierre angulaire de l'histoire de la musique et de la culture populaire de la seconde moiti du XXe sicle.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "Sgt. Pepper's Lonely Hearts Club Band es el octavo lbum de estudio de la banda britnica The Beatles. Es a menudo citado por la crtica como una de sus mejores obras y uno de los discos ms influyentes de todos los tiempos, apareciendo en el primer lugar de la lista de los 500 mejores lbumes de todos los tiempos en la revista Rolling Stone. Tambin fue seleccionado como el mejor lbum de rock de todos los tiempos por el sitio de Internet Digital Dream Door en su lista 100 Greatest Rock Albums. Se grab en un periodo de 129 das, y fue lanzado el 26 de mayo de 1967 en el Reino Unido (cinco das antes de la fecha prevista, el 1 de junio de 1967) y el 2 de junio en Estados Unidos.\n\nInmediatamente despus de salir a la venta, se convirti en una sensacin popular. Innovador en muchos sentidos, desde la estructura hasta las tcnicas de grabacin, influy en casi todos los trabajos de los gneros pop y rock que se hicieron despus. Es uno de los seis lbumes certificados con disco de diamante de The Beatles, lo que los convierte en los mximos ganadores de este reconocimiento en la historia de la msica. Los otros lbumes con disco de diamante son The Beatles/1962-1966, The Beatles, Abbey Road, The Beatles/1967-1970 y 1. En 1968 gan el Premio Grammy a Mejor lbum del ao.",
  strDescriptionPT: "Sgt. Pepper's Lonely Hearts Club Band  o oitavo lbum lanado pela banda britnica de rock The Beatles.  frequentemente citado como o melhor e mais influente lbum da histria do rock e da msica. Gravado em 129 dias em aproximadamente 700 horas, foi lanado em 1 de junho de 1967 na Inglaterra, e no dia seguinte nos Estados Unidos. Considerado como lbum inovador desde sua tcnica de gravao at a elaborao da capa. Pelo pouco apelo comercial, no foi tocado nas rdios, mas vendeu 11 milhes de cpias s nos Estados Unidos. Em 2003, a revista especializada em msica Rolling Stone colocou Sgt. Pepper's no primeiro lugar de uma lista dos 200 lbuns definitivos no Rock and Roll Hall of Fame.\n\nDois dos maiores sucessos da banda, Strawberry Fields Forever e Penny Lane, estariam em Sgt.Peppers, mas foram lanados como um compacto. O disco recebeu quatro Grammys, entre eles \"lbum do Ano\".",
