  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: 'Please Please Me fue el primer lbum grabado por los Beatles, editado el 22 de marzo de 1963 en el Reino Unido. Su publicacin acompaa el inicio de la Beatlemana, despus del xito de los sencillos Please Please Me (n 1 en varias listas musicales inglesas, pero solo n 2 en el Record Retailer ) y Love Me Do (n 17 en el Record Retailer). Adems de los cuatro ttulos en los singles, el lbum contiene diez canciones grabadas el da 11 febrero de 1963 en los estudios EMI de Abbey Road, durante una sesin de grabacin de "maratn" de 585 minutos. El disco contiene ocho canciones que fueron compuestas por John Lennon y Paul McCartney, temprana evidencia de lo que Rolling Stone denomin posteriormente como [la invencin por parte de ellos] de la idea de un grupo de msica rock hecho a s mismo, escribiendo sus propios xitos y tocando sus propios instrumentos musicales. Aunque la mayor parte de las canciones fueran cantadas por Lennon o McCartney, solos o en do, George Harrison participa en el coro y presta su voz para dos canciones, mientras que Ringo Starr es intrprete de una. Los catorce temas son tpicos del repertorio que la banda tocaba durante aos en clubes de Liverpool y Hamburgo. La cubierta est ilustrada con una fotografa de los cuatro en las escaleras de la sede de la compaa EMI en Londres, parodiada por el grupo seis aos despus. Desde el lanzamiento de Please Please Me, los Beatles aumentaron su popularidad en todo el mundo, principalmente en el Reino Unido, donde el lbum lleg al puesto nmero 1 el da 11 de mayo de 1963, permaneciendo en ese puesto durante 30 semanas hasta el 7 de diciembre de 1963, fecha en la que fue sustituido en la primera posicin por el segundo LP del grupo, With the Beatles.',
  strDescriptionPT: 'Please Please Me  o primeiro lbum gravado em estdio e lanado pelos Beatles, em 22 de maro de 1963. O lbum contm 14 canes, oito escritas por Lennon/McCartney. Em 2003, a revista Rolling Stone listou o lbum no nmero 39 na lista de 500 melhores lbuns de todos os tempos. A Rolling Stone tambm colocou as canes "I Saw Her Standing There" (em #130) e "Please Please Me" (#184) na lista de 500 melhores canes de todos os tempos.\n\nNos Estados Unidos, a maioria das canes de Please Please Me foram lanadas no lbum da Vee-Jay Records chamado Introducing... The Beatles em 1964, e depois no lbum da Capitol Records chamado The Early Beatles em 1965. O lbum Please Please Me no foi lanado neste pas at a padronizao mundial do catlogo dos Beatles.',
