  strAlbum3DThumb: null,
  strDescriptionEN: "With The Beatles is the second studio album by the English rock group The Beatles. It was released on 22 November 1963 on Parlophone, and was recorded four months after the band's debut Please Please Me. The album features eight original compositions (seven by Lennon-McCartney and \"Don't Bother Me\", George Harrison's first recorded solo composition and his first released on a Beatles album) and six covers (mostly of Motown and R&B hits). Most of the songs from the album were released in the United States by Capitol Records as the Meet The Beatles! LP on 20 January 1964, and the remaining that were not, featured on their next US album, The Beatles' Second Album.\n\nThe album was also released in November 1963 by Capitol Records in Canada, with a slight change to the title: Beatlemania! With The Beatles. This release has the distinction of being the first LP of Beatles material released in North America, pre-dating the Capitol US Meet The Beatles! and the Vee Jay Records Introducing... The Beatles LPs by two months.\n\nThe LP had advance orders of a half million and sold another half million by September 1965, making it the second album to sell a million copies in the United Kingdom, after the soundtrack to the 1958 film South Pacific. With The Beatles stayed at the top of the charts for 21 weeks, displacing Please Please Me, so that The Beatles occupied the top spot for 51 consecutive weeks. It even reached number 11 in the \"singles charts\" (because at the time UK charts counted all records sold, regardless of format). EMI Australia did not receive the cover art, and used a caricature of the band in a similar style to the black-and-white photograph on other releases. The Beatles were unaware of this until fans showed them the cover during their only Australian tour, and informed the EMI publicity staff that they were not pleased with the substitution.\n\nOn 26 February 1987, With The Beatles was officially released on compact disc (in mono only, catalogue number CDP 7 46436 2). Having been available only as an import in the US in the past, the album was also issued domestically in the US on LP and cassette on 21 July 1987. Along with the rest of the Beatles' canon, it was re-released on CD in newly re-mastered stereo and mono versions on 9 September 2009.\n\nIn 2003, the album was ranked number 420 on Rolling Stone magazine's list of the 500 greatest albums of all time.",
  strDescriptionDE: null,
  strDescriptionFR: "With The Beatles est le deuxime album des Beatles, paru le 22 novembre 1963 en Grande-Bretagne. Il est enregistr dans la foule de la sortie du single She Loves You, qui bat des records de vente alors que la Beatlemania bat son plein. Au milieu des tournes en Europe, le groupe enregistre en sept journes de travail, tales sur trois mois, quatorze chansons composes en grande partie par le duo Lennon/McCartney.\n\nEnregistr quatre mois aprs leur premier album, Please Please Me, l'album contient huit chansons originales (incluant la toute premire composition de George Harrison) et six reprises, la plupart de succs de rhythm and blues de la Motown. Plus que pour leur album prcdent, les Beatles ont recours  de nouveaux instruments et techniques de studio, notamment pour doubler leur voix. L'album, qui est gnralement moins connu que son prdcesseur, est cependant jug plus mr.\n\nCe deuxime opus connat un norme battage mdiatique, battant les records de pr-commande, et dtrne Please Please Me pour siger 21 semaines en tte des classements britanniques. Outre ses records de vente, il s'agit du premier disque des Beatles  faire l'objet de critiques dans un journal srieux, le Times. La majorit des chansons de l'album sont rutilises sur l'album amricain Meet The Beatles!, sorti le 20 janvier 1964.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "With the Beatles fue el segundo lbum de estudio britnico de los Beatles, grabado cuatro meses despus de publicarse Please Please Me, y editado el 22 de noviembre de 1963 en mono (PMC 1206) y en estreo (PCS 3045) en el sello discogrfico Parlophone. Presentaba ocho composiciones originales incluyendo la primera de George Harrison y seis versiones, la mayora de la Motown y el R&B.\n\nEl LP tuvo un pre-pedido de medio milln de copias y vendi otro medio milln para septiembre de 1965, y se convirti en el segundo lbum que venda un milln de copias en el Reino Unido, pues el primero en conseguirlo fue la banda sonora original de la pelcula South Pacific (1958). Se mantuvo en la cima de la lista durante veintin semanas, y desplaz a Please Please Me, de manera que los Beatles ocuparon el primer puesto durante cincuenta y un semanas consecutivas entre los dos lbumes. Incluso lleg a alcanzar el nmero once en la lista de sencillos en aquella poca, las listas del Reino Unido contaba todas las grabaciones vendidas, independientemente del formato que tuvieran.\n\nEn el ao 2012, la revista Rolling Stone clasific a With the Beatles en el puesto 419 en su lista de los 500 mejores lbumes de todos los tiempos.",
  strDescriptionPT: 'With the Beatles  o segundo lbum do grupo de rock ingls The Beatles, lanado em 22 de novembro de 1963, no mesmo dia em que o presidente dos Estados Unidos John F. Kennedy era assassinado em Dallas, Texas.\n\nGravado quatro meses aps ser lanado o primeiro lbum, repetia a frmula de Please Please Me. Selecionaram-se 7 composies prprias de Lennon/McCartney e incluiu-se novamente 6 covers das prediletas do repertrio dos Beatles. George Harrison comparece com uma composio prpria "Don\'t Bother Me" neste trabalho cujo carro-chefe firmou-se at hoje com a msica "All My Loving".',
