  strAlbum3DFace: null,
  strAlbum3DThumb: null,
  strDescriptionEN: "Rubber Soul is the sixth studio album by the English rock group The Beatles, released in December 1965. Produced by George Martin, Rubber Soul was recorded in just over four weeks to make the Christmas market. Unlike the five albums that preceded it, Rubber Soul was recorded during a specific period, the sessions not dashed off in between either tour dates or during filming projects. After this, every Beatles album would be made without the need to pay attention to other commitments, except for the production of short promotional films or principal photography and editing to Magical Mystery Tour. The album was described as a major artistic achievement, attaining widespread critical and commercial success, with reviewers taking note of The Beatles' developing musical vision.\n\nRubber Soul was successful commercially and critically, and is often cited as one of the greatest albums in music history. In 2012, Rubber Soul was voted 5th on Rolling Stone magazine's list of the \"500 Greatest Albums of All Time\".",
  strDescriptionDE: null,
  strDescriptionFR: "Rubber Soul est le sixime album des Beatles, paru le 3 dcembre 1965 en Grande-Bretagne. Il est enregistr peu de temps aprs la sortie de Help!, en seulement cinq semaines d'octobre et novembre 1965, afin dtre disponible pour les ftes de Nol. Les Beatles russissent malgr les contraintes  fournir quatorze chansons originales.\n\nCe deuxime opus de l'anne 1965 est un album-charnire dans la carrire des Beatles. Toutes les chansons sont des compositions originales, comme sur A Hard Day's Night, crites par les membres du groupe ; il en est ainsi pour tous les albums suivants. Les Fab Four sortent de leur priode  bons garons souriants et gais , et crivent des textes beaucoup plus mrs qu'auparavant. Le groupe s'inspire par ailleurs de Bob Dylan pour les paroles. John Lennon et Paul McCartney y traitent, entre autres, des relations amoureuses complexes. L'instrumentation s'largit, notamment avec l'introduction du sitar, et surtout la trame habituelle de leurs chansons (A-B-pont musical-reprise de B) fait place  des alternances plus labores.\n\n sa sortie, Rubber Soul est acclam par la critique et connat, comme ses prdcesseurs, un norme succs commercial. Au Royaume-Uni, il entre directement  la premire place des hit-parades et y reste huit semaines. Il parat aux tats-Unis le 6 dcembre 1965, sous une forme lague et dnature, et reste 59 semaines dans le hit-parade amricain. Il occupe la premire place pendant six semaines en janvier et fvrier 1966. On dnombre 1 200 000 copies vendues en neuf jours, et quatre millions jusqu' aujourd'hui, seulement en Amrique.\n\nSubtile coquetterie : sr maintenant de sa notorit universelle, le groupe ne juge pas mme utile de faire figurer son nom au recto de la pochette !",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "Rubber Soul es el sexto lbum de estudio de la banda britnica The Beatles, lanzado el 3 de diciembre de 1965. Producido por George Martin, fue grabado en slo cuatro semanas para as poder aprovechar el mercado navideo. A diferencia de sus cinco lbumes anteriores, Rubber Soul fue el primero en ser grabado por sus autores durante un periodo especfico concreto, sin ser interrumpido por giras musicales o proyectos flmicos entre las sesiones de grabacin del lbum. El lbum fue descrito como un logro artstico importante de la banda, teniendo un amplio xito comercial y de crtica, y haciendo que los encargados de la resea tomasen nota de la visin musical que The Beatles iban desarrollando.\n\nLa edicin original britnica reflejaba la influencia del soul que mostraba el ttulo de la portada del lbum. El listado de canciones cambiaba en la edicin estadounidense, que inclua dos canciones acsticas provenientes del disco anterior britnico Help!, dando a la versin americana una impronta de folk rock que los crticos atribuan a The Byrds y Bob Dylan.\n\nRubber Soul es a menudo citado como uno de los mejores lbumes en la historia de la msica popular. En 2001, la cadena de msica por cable VH1 lo coloc en el nmero 6 de entre los mejores cien de la historia. En noviembre de 2003, la revista Rolling Stone lo coloc en el puesto 5 de su lista de los 500 mejores lbumes de todos los tiempos. A excepcin del lbum britnico A Hard Day's Night (todas las canciones atribuidas a LennonMcCartney), ste es el primer lbum de The Beatles (tanto en el Reino Unido como en los Estados Unidos) en que solo contena temas compuestos por la banda.",
  strDescriptionPT: 'Rubber Soul  o sexto lbum lanado pelo grupo de rock The Beatles. Foi gravado aproximadamente em quatro meses e lanado em 1965 sendo produzido por George Martin.  citado por muitos crticos de msica como o lbum em que os Beatles comearam a tornar seu som mais ecltico e sofisticado. Este lbum est na lista dos 200 lbuns definitivos no Rock and Roll Hall of Fame.\n\nNaquela altura, depois de amenizada a fora primitiva do Rock, com a exploso do folk-rock e da surf music, cada grupo passou a utilizar-se de todas as potencialidades que os estdios de gravao podiam oferecer. Os prprios Beatles superaram sua fase adolescente, passando pelas brincadeiras colocadas em filmes por Richard Lester, at o profundo universo potico que comearam a desenvolver com o lbum Rubber Soul. Realizaram ento verdadeiras "rupturas", como a letra surrealista e o uso do sitar em "Norwegian Wood", o lirismo de "In My Life" e "Michelle", a solido pungente de "Nowhere Man", enfim, Rubber Soul foi considerado o mais inovador lbum de rock lanado at ento.',
