  strDescriptionEN: "Yellow Submarine is the tenth studio album by The Beatles in the United Kingdom, released on Apple Records. It was issued as the soundtrack to the film of the same name, which premiered in the United Kingdom seven months prior to the album's release.",
  strDescriptionDE: null,
  strDescriptionFR: "Yellow Submarine est le dixime album des Beatles, paru le 13 janvier 1969 aux tats-Unis et le 17 janvier en Grande-Bretagne. Il s'agit de la bande originale du film d'animation du mme nom sorti en salles sept mois auparavant. Des treize chansons de cet album, seulement six sont des Beatles, parmi lesquelles quatre sont indites. Les titres Yellow Submarine et All You Need Is Love ont en effet dj t commercialises auparavant. Les sept titres sur la face B de la bande originale sont des pices instrumentales ralises pour le film, composes et enregistres par George Martin, et auxquelles aucun des Beatles ne participe.\n\nLes quatre nouvelles chansons sont enregistres entre fvrier 1967 et fvrier 1968 aux studios EMI d'Abbey Road et aux studios De Lane Lea, tandis que les orchestrations sont enregistres les 22 et 23 octobre 1968. Concernant les chansons des Beatles, deux sont l'uvre de George Harrison. La plus grande partie des chansons ont galement recours  de nombreux overdubs, qu'il s'agisse d'ajout d'effets sonores ou d'instruments comme des cuivres. Aucun des titres n'est vritablement compos pour cet album, ou pour le dessin anim qui met en scne le groupe. Les genres musicaux vont du simple rock au psychdlisme pouss.\n\nL'album est souvent considr comme le moins bon du groupe, et ne s'impose en tte des hit-parades ni en Grande-Bretagne ni aux tats-Unis : il doit dans les deux cas se heurter  la concurrence de l' album blanc  que le groupe a publi deux mois auparavant. Les Beatles eux-mmes ne prtent que peu d'attention  cet album, qui doit les fans par son manque de contenu original et ses parties orchestrales qui semblent hors de propos sur un album des Fab Four. Une version de la bande originale avec uniquement des chansons du groupe, Yellow Submarine Songtrack, est publie tardivement en 1999 pour pallier ce fait.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "Yellow Submarine es un lbum del grupo de msica rock britnico The Beatles lanzado a principios de 1969. En contraste con la riqueza de la pelcula de animacin Yellow Submarine, este disco se consider como su esfuerzo ms gris, ya que, ms que un lbum de estudio, solo era la banda sonora de la pelcula.\n\nCon la reedicin de la pelcula en 1999, fue editada una nueva versin del lbum, titulado Yellow Submarine Songtrack, en el cual estn incluidos todos los temas contenidos en la pelcula y que sustituan las partes orquestales de George Martin.",
  strDescriptionPT: 'Yellow Submarine  o lbum trilha-sonora lanado pelos The Beatles, que corresponde ao filme de mesmo ttulo.\n\nEm contraste com a recepo do filme pela crtica, este  considerado o disco mais fraco dos Beatles e o nico disco a no alcanar o 1 lugar nas paradas nos EUA e no Reino Unido (a melhor posio foi o 2 lugar, curiosamente com o "lbum Branco", lanado 2 meses antes, em 1 lugar).  um lbum que destoa do resto da discografia da banda, j que somente as seis msicas do lado A so do grupo e apenas quatro delas so inditas e ainda assim foram gravadas entre 1967 e 1968.',
