  strAlbumSpine: null,
  strAlbum3DCase: null,
  strAlbum3DFlat: null,
  strAlbum3DFace: null,
  strAlbum3DThumb: null,
  strDescriptionEN: "A Hard Day's Night is the third studio album by The Beatles, released on 10 July 1964, with side one containing songs from the soundtrack to their film A Hard Day's Night. The American version of the album was released two weeks earlier, on 26 June 1964 by United Artists Records, with a different track listing. This is the first Beatles album to be recorded entirely on four-track tape, allowing for good stereo mixes.\n\nWhile showcasing the development of the band's songwriting talents, the album sticks to the basic rock and roll instrumentation and song format. The album contains some of their most famous songs, including the title track, with its distinct, instantly recognisable opening chord, and the previously released \"Can't Buy Me Love\"; both were transatlantic number-one singles for the band.\n\nThe title of the album was the accidental creation of drummer Ringo Starr. According to Lennon in a 1980 interview with Playboy magazine: \"I was going home in the car and Dick Lester [director of the movie] suggested the title, 'Hard Day's Night' from something Ringo had said. I had used it in 'In His Own Write', but it was an off-the-cuff remark by Ringo. You know, one of those malapropisms. A Ringo-ism, where he said it not to be funny... just said it. So Dick Lester said, 'We are going to use that title.'\"\n\nIn 2000, Q placed A Hard Day's Night at number five in its list of the 100 Greatest British Albums Ever. In 2012, A Hard Day's Night was voted 307th on Rolling Stone magazine's list of the \"500 Greatest Albums of All Time\".",
  strDescriptionDE: null,
  strDescriptionFR: "A Hard Day's Night est le troisime album des Beatles, paru le 10 juillet 1964 en Grande-Bretagne, sur le label Parlophone, en tant que bande originale de leur premier film, qui porte le mme nom (Quatre garons dans le vent en version francophone). Seules les chansons de la face A du disque figurent dans le long-mtrage, bien que certaines de la face B aient t galement composes  cet usage. L'album sort le 26 juin aux tats-Unis, dit par United Artists, avec une lgre diffrence dans la liste des chansons.\n\nIl est enregistr dans la premire partie de l'anne 1964, alors que les Beatles passent du statut de vedettes dans leur propre pays, o la Beatlemania a pris naissance quelques mois plus tt,  celui de superstars mondiales. Puisqu'un film mettant en scne cet incroyable phnomne, qui emporte toute la gnration des baby boomers, est en prparation, Paul McCartney et surtout John Lennon doivent pour la premire fois  composer sur commande . Ils crivent toutes les chansons de cet album, qui est donc le premier des Beatles  ne comporter aucune reprise, et qui reste le seul intgralement sign Lennon/McCartney.\n\nLe titre de l'album, de la chanson qui l'ouvre et du film provient d'un accident de langage de Ringo Starr ( Ce fut une dure journe de nuit , ou  Ce fut la nuit d'une dure journe ), que John Lennon avait dj utilis dans son livre In His Own Write. Ce troisime 33 tours du groupe en l'espace de dix-huit mois se distingue notamment par le son de la guitare lectrique  douze cordes employe ici pour la premire fois par George Harrison.\n\nDe janvier  juin 1964, au milieu d'un inimaginable tourbillon qui les voit notamment conqurir l'Amrique, les Fab Four ralisent donc un album qui passe 21 semaines en tte du hit-parade britannique, et 14 semaines  la premire place des classements aux tats-Unis (o les chansons de l'album original sont rparties sur deux publications, A Hard Day's Night et Something New, distribues respectivement par United Artists et Capitol). Deux singles et deux EPs sont galement publis et connaissent un destin identique des deux cts de l'Atlantique, tandis que le film, qui est  l'affiche dans le mme temps, connat un succs international.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "A Hard Day's Night fue el tercer lbum de estudio britnico grabado por los Beatles, publicado el 10 de julio de 1964 por la compaa discogrfica Parlophone, con el nmero de catlogo PMC 1230 (mono) y PCS 3058 (estreo).\n\nAlcanz la posicin uno y desbanc al anterior LP del grupo, With the Beatles, y permaneciendo en ese puesto durante veintin semanas de las treinta y ocho que se mantuvo en lista",
  strDescriptionPT: 'A Hard Day\'s Night  o terceiro lbum da banda britnica The Beatles. Lanado em 1964, na Inglaterra, acompanhando o lanamento do filme homnimo.\n\nA verso britnica do lbum no representa exatamente a trilha sonora do filme, como a verso americana que contm as msicas instrumentais do filme, alm das msicas interpretadas pelos Beatles. A verso americana do lbum, no entanto, no contm todas as canes da verso britnica. A verso britnica tambm foi lanada com a capa mostrando o nome da banda e do lbum, enquanto a capa da verso americana reala o ttulo com a manchete: "ORIGINAL MOTION PICTURE SOUND TRACK" ("trilha sonora original do filme").\n\nO lbum foi o primeiro a trazer s composies de Lennon/McCartney. Trouxe tambm msicas de sucesso como "A Hard Day\'s Night", "I Should Have Known Better", "If I Fell", "Can\'t Buy Me Love" e a primeira balada popular escrita por Paul McCartney, "And I Love Her".\n\nO filme, em preto e branco foi dirigido por Richard Lester. Mostrava a histria de uma banda de rock que era perseguida por fs histricos. Aps perseguies de fs, entrevistas, e muito humor, a banda realiza um show na televiso. O filme mostra um pouco da realidade dos Beatles na poca. No Brasil, o lbum e o filme foram lanados pelo nome de "Os reis do i, i, i".',
