  strAlbum3DThumb: null,
  strDescriptionEN: "Magical Mystery Tour is an LP and a double EP by the English rock group The Beatles, produced by George Martin, both including the six-song soundtrack to the 1967 film of the same name. The material was released in the United Kingdom on 8 December 1967 as a six-track double EP on the Parlophone label; in the United States the record, released on 27 November 1967, was an eleven-track LP created by Capitol Records, adding the band's 1967 single releases. The EP was also released in Germany, France, Spain, Yugoslavia, Australia and Japan.\n\nThe US LP was later adopted as the official version of the record when The Beatles' catalogue was updated for the 1980s digital Compact Disc releases. It did not see an official 11 track LP release in the United Kingdom until 1976. The album was remastered 9 September 2009 for the first time since its CD release. The soundtrack was a critical and commercial success, a #1 album in the US and Grammy-nominated, despite the relative critical and commercial failure of the Magical Mystery Tour film.",
  strDescriptionDE: null,
  strDescriptionFR: "Magical Mystery Tour est un album des Beatles, sorti le 27 novembre 1967 aux tats-Unis paralllement au film du mme nom tandis que la version anglaise, mise en vente le 8 dcembre 1967, est un double maxi de la bande originale contenant les six titres lis au film. La bande originale est compose de six morceaux composs et enregistrs durant l't et l'automne 1967, dans la foule du succs de Sgt. Pepper et de la mort de Brian Epstein.\n\nDeux titres s'y dmarquent particulirement, The Fool on the Hill et I Am the Walrus, tandis que la face B de l'dition amricaine est prtexte  la runion de tous les singles publis par le groupe durant l'anne, notamment All You Need Is Love, Strawberry Fields Forever et Penny Lane. Ces chansons marquent les derniers feux de la priode psychdlique du groupe, les Beatles s'cartant de ce genre ds l'anne suivante.\n\nQu'il s'agisse de l'EP britannique ou de l'album amricain, le disque connat un grand succs, atteignant le sommet des charts de sa catgorie aux tats-Unis, et la deuxime place des classements de singles en Angleterre (chose rare pour un double EP). La formule amricaine se rvle cependant plus convaincante, et est gnralise  partir du milieu des annes 1970.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "Magical Mystery Tour es un lbum de la banda de rock britnica The Beatles. Fue lanzado en Estados Unidos el 27 de noviembre de 1967. Las canciones de este lbum fueron grabadas por los Beatles durante un perodo de 11 meses de extremada creatividad, que inclua el lbum Sgt. Pepper's Lonely Hearts Club Band.\n\nTambin es el nombre de una pelcula para televisin que sali al aire originalmente en el Reino Unido. Despus de la acogida negativa, tanto de la crtica como del pblico, que tuvo el estreno, se cancelaron los planes de emisin de dicha pelcula por parte de la cadena de televisin norteamericana ABC, y la pelcula Magical Mystery Tour no apareci en los Estados Unidos hasta su estreno en 1976 en los cines de medianoche y los circuitos universitarios.",
  strDescriptionPT: 'Magical Mystery Tour  a trilha sonora do filme homnimo estreado pelos Beatles em dezembro de 1967 no canal de TV britnico BBC. Lanado no dia 27 de novembro de 1967 no formato LP (Long Play) nos EUA, e no dia 8 de dezembro de 1967 no formato EP (Extended Play) duplo na Inglaterra. O resto do mundo seguiu o formato ingls.\n\nAps o choque da morte de Brian Epstein, os quatro Beatles se reuniram no dia 1 de setembro de 1967 para traar os rumos da banda. Decidiram seguir com o projeto "Magical Mystery Tour" e no dia 5 de setembro iniciam a gravao de I Am the Walrus. Este projeto geraria sete canes e um filme.\n\nCom apenas seis msicas, a EMI decidiu lan-lo no formato EP duplo, junto a um mini-livro de 28 pginas e com as letras das canes. A Capitol Records, gravadora responsvel pelos lanamentos dos Beatles nos EUA, no achou conveniente este formato para o mercado americano e resolveu lan-lo no formato LP. Para isso, concentrou todas as msicas do lanamento em EP no lado 1, e utilizou as cinco msicas lanadas durante o ano de 1967 com compacto simples no lado 2. O formato do lanamento ingls foi seguido pelo resto do mundo, inclusive no Brasil. O formato americano permaneceu indito no mundo at novembro de 1976, quando atendendo a pedidos dos fs foi editado na Inglaterra, e em seguida ao redor do mundo. Atualmente, este  o formato que prevalece.',
  strDescriptionSE: null,
