  intScoreVotes: "2",
  strReview: "On the whole, Magical Mystery Tour is quietly one of the most rewarding listens in the Beatles' career. True, it doesn't represent some sort of forward momentum or clear new idea-- largely in part because it wasn't conceived as an album. The accompanying pieces on the EP are anomalies in the Beatles oeuvre but they aren't statements per se, or indications that the group is in any sort of transition. But if there was ever a moment in the Beatles' lifetime that listeners would have been happy to have the group just settle in and release songs as soon as possible, it was just before and after the then-interminable 10-month gap between the Revolver and Sgt. Pepper's. Without that context, the results could seem slight-- a sort-of canonized version of Past Masters perhaps-- but whether it's an album, a collection of separate pieces, or whatnot matters little when the music itself is so incredible.",
