  strAlbum3DThumb: null,
  strDescriptionEN: 'Let It Be is the 12th and final studio album released by the English rock band The Beatles. It was released on 8 May 1970 by the band\'s Apple Records label shortly after the group announced their break-up.\n\nMost of Let It Be was recorded in January 1969, before the recording and release of the album Abbey Road. For this reason, some critics and fans, such as Mark Lewisohn, argue that Abbey Road should be considered the group\'s final album and Let It Be the penultimate. Let It Be was originally intended to be released before Abbey Road during mid-1969 as Get Back, but The Beatles were unhappy with this version, which was mixed and compiled by Glyn Johns, and it was temporarily shelved. A new version of the album was created by Phil Spector in 1970 and finally released as Let It Be, serving as the album for the 1970 motion picture of the same name. While three songs from the sessions were released as singles before the album\'s release, "Get Back"/"Don\'t Let Me Down" and "Let It Be", the songs were remixed by Spector for the album and "Don\'t Let Me Down" was not included.\n\nDespite a mixed review from Rolling Stone magazine at the time of its release, the album was ranked number 86 in the magazine\'s list of the 500 greatest albums of all time in 2003. This was, however, adjusted to #392 in the 2012 version.\n\nLet It Be... Naked was released in 2003, an alternative version of the album stripping much of Phil Spector\'s production work and using some different versions of songs.',
  strDescriptionDE: null,
  strDescriptionFR: "Let It Be est le douzime et dernier album original publi par les Beatles, paru le 8 mai 1970 en Grande-Bretagne, et dix jours plus tard aux tats-Unis. Au moment de sa sortie, le groupe est dj officiellement spar, depuis une annonce faite par Paul McCartney le 10 avril. Les chansons prsentes sur ce disque ont t enregistres plus d'un an avant leur parution, l'essentiel tant mis en bote en janvier 1969, avant la ralisation de l'album Abbey Road, publi en septembre 1969. Pour cette raison, Let It Be n'est pas considr comme l'ultime album des Beatles, puisqu'il n'est pas le dernier enregistr.\n\nL'album, suppos paratre  l't 1969 sous le titre Get Back, est conu au dpart comme un retour aux sources : quatre musiciens jouant du rock dans des conditions live. De plus, le tout doit dboucher sur un film. Mais les difficults, qu'elles soient d'ordre relationnel ou logistique, s'accumulent durant sa ralisation. Insatisfaits du rsultat, les Beatles abandonnent le projet. Hormis trois chansons issues de ces sessions (Get Back, Don't Let Me Down et Let It Be) publies en single, les kilomtres de bandes enregistres en un mois sont dans un premier temps ranges au placard avant que Allen Klein, le nouveau manager du groupe, ne dcide de les confier au producteur amricain Phil Spector, sans consulter Paul McCartney. En mars 1970, Spector post-produit toutes les chansons  sa manire, rejette Don't Let Me Down de la liste, et le disque parat finalement en mai sous le nom de Let It Be, en mme temps que le film du mme nom.\n\nLet It Be est le seul album du groupe, avec A Hard Day's Night, sur lequel Ringo Starr ne chante pas. C'est, par ailleurs, l'unique uvre des Beatles o George Martin, quoique prsent au dbut du projet, n'est pas crdit en tant que producteur. Quant au travail de Phil Spector, il est sujet  controverse et entrane, 33 ans plus tard et sous l'impulsion de Paul McCartney, la publication d'une version  dspectorise  : Let It Be Naked.\n\nCe dernier album officiel des Beatles est initialement commercialis sous la forme d'un coffret incluant le disque vinyle et un livre. L'album seul n'est disponible qu'en novembre. Il bat tous les records de pr-commandes avant parution aux tats-Unis.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "Let It Be es el ltimo lbum de estudio lanzado por The Beatles como grupo, a pesar de que fue grabado antes que Abbey Road. Editado en el Reino Unido, el disco sali al mercado el 8 de mayo de 1970.\n\nSe trata de un lbum controvertido desde su concepcin: una vez que dejaron de tocar en vivo en 1966 por la imposibilidad de plasmar su msica en el escenario, los Beatles se propusieron grabar un lbum para tocar un ltimo concierto en vivo, tal vez en un barco o en un lugar pblico. Por tanto, las sesiones de grabacin del disco (que por aquel entonces se llamaba Get Back, aludiendo al regresar a las races rockeras del grupo) comenzaron a ser filmadas, en 1969, por el cineasta Michael Lindsay-Hogg. Los ensayos fueron tensos, con constantes discusiones entre los miembros del grupo, que desde sus discos anteriores denotaban una convivencia cada vez peor y ms hostil entre ellos.\n\nEn 2003, Rolling Stone lo coloco en el puesto 86 de su lista de los 500 mejores lbumes de todos los tiempos.",
  strDescriptionPT: "Let It Be  o dcimo terceiro e ltimo lbum lanado pelo grupo ingls de rock The Beatles. Gravado entre janeiro de 1969 e maro/abril de 1970, o lbum foi somente lanado em 8 de maio de 1970, aps o disco Abbey Road (ltimo disco gravado) e juntamente com o documentrio com o mesmo nome. Inicialmente estava previsto chamar-se Get Back.\n\nAs msicas 'Let It Be' e 'Get Back' foram lanadas como \"singles\" no Reino Unido, mas em verses diferentes das encontradas no lbum. 'The Long And Winding Road' foi lanada como single nos EUA.",
