  strDescriptionES: 'Past Masters es un lbum recopilatorio de dos tomos de The Beatles publicado en 1988 despus de la publicacin en 1987 de los lbumes de estudio del Reino Unido en CD. Past Masters recoge las pistas que no fueron lanzadas en lbumes de estudio, de modo que todo el catlogo de la banda podra estar disponible en CD. Past Masters contiene todas las canciones no incluidas en los 12 lbumes originales de Reino Unido o el LP Magical Mystery Tour que fueron lanzados comercialmente por EMI desde 1962 hasta 1970. La mayor parte del lbum consiste en los lados A y B de los sencillos de la banda (incluidas las versiones individuales de canciones que aparecen diferente en los lbumes), adems de todo el contenido nico del Reino Unido y el EP Long Tall Sally, dos grabaciones en lengua alemana, una cancin grabada para el mercado estadounidense y una pista utilizada en una compilacin de caridad completan la coleccin.\n\nPast Masters se public inicialmente en dos CD separados, el 7 de marzo de 1988, con dos LP de vinilo combinados, el 24 de octubre de 1988 en los Estados Unidos y el 10 de noviembre de 1988 en el Reino Unido. Los CD originales fueron incluidos en The Beatles Box Set en 1988. Un juego de dos CD de ambos volmenes, con dos nuevas mezclas estreo fue lanzado el 9 de septiembre de 2009 como parte del proyecto de la versin remasterizada de The Beatles. Esta versin se incluy en The Beatles Stereo Box Set. En The Beatles in Mono, un lbum titulado Mono Masters tom el lugar de Past Masters, que contiene una lista de pistas similares en las mezclas en mono originales. Las listas de canciones del segundo disco son diferentes, lo que refleja el hecho de que las canciones ms tarde se mezclaron o se lanzaron nicamente en estreo.\n\nEste fue el ltimo lbum de The Beatles lanzado como un disco de gramfono antes de que la industria discogrfica lo dejara de fabricar en grandes cantidades a favor del formato disco compacto.\n\nAmbos volmenes de Past Masters fueron lanzados en un juego de dos CD, como parte del catlogo remasterizado de The Beatles el 9 de septiembre de 2009, con dos canciones anteriormente publicadas nicamente en mono se compilaron en estreo: "From Me to You" y "Thank You Girl". Tambin se incluy en The Beatles Stereo Box Set.\n',
