  strDescriptionEN: "Past Masters is a two-volume compilation album set by The Beatles which was released in 1988 as part of the issue of the bands entire back catalogue on CD. Compiled by the noted Beatles authority Mark Lewisohn, this collection of many of the band's biggest hits as well as rarities includes every song released commercially by the band that was not available on The Beatles twelve original UK albums or the Magical Mystery Tour LP.\n\nThe majority of the Past Masters set consists of A and B-sides from the band's singles, including single versions of songs that appeared in a different form on the band's albums. Also included are the full contents of the UK-only Long Tall Sally EP, two German language tracks, a song recorded for the American market and a track released on a charity compilation album.\n\nThe \"Past Masters\" name had previously been used by EMI for a series of three unrelated reissue singles.",
  strDescriptionDE: null,
  strDescriptionFR: "Past Masters est une compilation en deux volumes du groupe britannique The Beatles, commercialise en 1988. Une rdition remastrise et regroupe en un CD double parat en septembre 2009. Le 13 novembre 2012, une version 33 tours de cet album double est publie1.\n\nLes Past Masters runissent les chansons principalement publies sur des singles (format 45 tours). Cette publication complte la discographie des Beatles dans la mesure o la grande majorit de ces titres n'taient pas prsents sur les treize albums officiels sortis durant leurs sept annes d'enregistrements. On y retrouve aussi quelques chansons parues sur leurs 33 tours mais dites en single dans des versions diffrentes.\n\nPlusieurs pices de cette compilation se sont classes N1 dans les hit-parades des deux cts de l'Atlantique.\n\nDisque 1\nOriginalement publi en CD en 1988 sous le titre Past Masters, Volume 1, le disque 1 contient des chansons publies par les Beatles entre 1962 et 1965 qui ne figuraient pas sur leurs albums officiels. Une exception tant Love Me Do qui apparat ici sous sa version originale du single enregistr le 4 septembre 1962 avec Ringo Starr  la batterie. Sur la version de l'album, c'est Andy White qui,  l'invitation de George Martin, s'occupe de la rythmique.\n\nLe disque contient :\n- Treize titres issus de leurs singles (faces A ou B) ;\n- Les quatre titres issus du maxi Long Tall Sally ;\n- La chanson Bad Boy publie sur lalbum amricain Beatles VI\n\nDisque 2\nMis  part la chanson Across the Universe, le disque 2 (originalement intitul Past Masters, Volume 2) contient les titres sortis en 45 tours entre dcembre 1965 et mars 1970. Ces morceaux ne figuraient pas sur leurs albums officiels,  l'exception des chansons Get Back, Let It Be, Across the Universe et Revolution. Ces deux premires pices sont les versions produites par George Martin, diffrentes de celles prsentes dans l'album Let It Be. La pice Across the Universe apparaissait sur un 33 tours caritatif comprenant des enregistrements de diffrents artistes britanniques pour le Fonds mondial pour la nature. Plus tard, une autre version remixe par Phil Spector se retrouvera aussi sur Let It Be. Quant au titre Revolution, il s'agit ici de sa version  rock , enregistre aprs le Revolution 1  blues  qui figure sur l' album blanc .\n\nAucun 45 tours de l'anne 1967 (soit, chronologiquement, Penny Lane/Strawberry Fields Forever, All You Need Is Love/Baby You're a Rich Man et Hello Goodbye/I Am the Walrus) n'est prsent sur le Past Masters. Ceci est d  la disparit entre les versions anglaise et amricaine de l'album Magical Mystery Tour. La version publie en Grande-Bretagne est un double maxi contenant les six titres qui apparaissent dans le tlfilm. En Amrique du Nord, par contre, sur la face B du 33 tours publi par Capitol Records, on ajoute 5 chansons tires des singles mentionns plus haut. Rapidement, les ventes en Angleterre de la version importe doutre mer dpassent celle du double maxi. Finalement, le 4 dcembre 1976, EMI publie  son tour la version augmente. Lors des rditions en CD de 1987 et de 2009, cest cette version de lalbum qui figurera dans la collection officielle.\n\n\nLors de la rdition du catalogue complet des Beatles en 2009, une version mono de Past Masters a t publie sous le nom Mono Masters. On y retrouve sensiblement les mmes chansons,  part Old Brown Shoe, The Ballad of John and Yoko et Let It Be qui ont t mixes qu'en stro. Par contre, on y a rajout les 4 titres indits du disque Yellow Submarine (Only a Northern Song, All Together Now, Hey Bulldog et It's All Too Much) qui furent mixes en mono  l'poque pour une ventuelle sortie en maxi mais qui n'a jamais vu le jour.",
