  strDescriptionEN: "Yellow Submarine Songtrack is a compilation/soundtrack album by the Beatles for the 1999 re-release of the 1968 film Yellow Submarine. The film was re-released on 13 September 1999 in the United Kingdom and the following day in the United States.\nIn sharp contrast with other Beatles remasters available (2009 box sets), the songs were fully remixed from the original multitrack tapes, something not done for the original Compact Disc release of the Beatles catalogue in the late 1980s except for Help! and Rubber Soul, not even in 2009.\nThis album contains only the Beatles songs used in the film, including tracks absent from the original Yellow Submarine album. The extra tracks replaced the George Martin film score from the original release, while the complete score was included as a DVD audio track in the CD/DVD package featuring the album and film.\nThe album debuted in the UK charts at No. 8 selling 19,000 copies in its first week. It also peaked at No. 15 on the Billboard 200, with 68,000 copies sold in its opening week. In France the album debuted at No. 13.\nThe album was reissued on CD on 4 June 2012 (5 June in North America) along with the film restored for DVD and Blu-ray release. While the original 1999 release was in a jewel-case, the 2012 version was released in a digipak, with the booklet and catalogue numbers the same as the earlier version, with a 1999 copyright date on the disc, and a 2012 date on the digipak.",
  strDescriptionDE: null,
  strDescriptionFR: "Yellow Submarine Songtrack est un album du groupe britannique The Beatles, publi en 1999 comme bande-originale pour la ressortie du film Yellow Submarine, originellement sorti en 1968. Il ne faut pas le confondre avec l'album Yellow Submarine de 1969, dont il reprend les six titres des Beatles mais auquel on ampute les thmes instrumentaux de George Martin qui constituaient sa face B. On y ajoute en revanche tous les morceaux du film qui figuraient sur d'autres albums.\n\nL'originalit de la compilation rside dans le fait que tous les morceaux sont prsents dans de nouveaux mixages audio raliss par George Martin, lgrement diffrents de ceux que l'on peut trouver sur les albums originaux.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "Yellow Submarine Songtrack es un lbum recopilatorio de The Beatles publicado en 1999, y que contiene canciones que aparecen en la pelcula animada de 1968 Yellow Submarine. Contiene sencillos (algunos con sus caras B). Todas las canciones fueron publicadas en el CD Yellow Submarine.\n\nEste lbum es descripto como el ms dbil de todas las recopilaciones de The Beatles hasta el momento, vendiendo muy poco en los principales pases, porque los discos de Los Beatles suelen escalar hasta el primer lugar en ventas, pero en este lo mximo que lo logro fue un 8 puesto en su pas natal Inglaterra.\n\nEl CD debut en el Reino Unido en el #8 vendiendo 19.000 copias en la primera semana y en los Estados Unidos #15 vendiendo 68.900 en su primera semana en Francia en el puesto#13 y en Argentina #9 vendiendo 4.680 copias la primera semana.\n\nLo interesante de estos temas es que son un Remix de los multitrack originales. Esta edicin pone las voces en el centro y los instrumentos rodendolas, dando una sensacin nueva, en esta ocasin se ha hecho una adecuada mezcla en estreo, el sonido de estos temas es increble, ya que en el momento de hacer las mezclas originales no se haba desarrollado adecuadamente esta tcnica, pues el estndar de audio era monoaural. Una de las canciones ms interesantes es Hey Bulldog, ya que la voz de Lennon se escucha con eco.",
  strDescriptionPT: "Yellow Submarine Songtrack  uma coletnea do grupo de rock ingls The Beatles feita em 1999, ela contm msicas gravadas entre 1965 e 1968, o produtor do lbum  George Martin, o lbum tem ao todo 45 minutos e 38 segundos, e as gravadoras dessa coletnea foram a Apple Inc., EMI e a Capitol.",
