  strAlbum3DThumb: null,
  strDescriptionEN: 'Beatles for Sale is the fourth studio album by the English rock band the Beatles, released on 4 December 1964 and produced by George Martin for Parlophone. The album marked a minor turning point in the evolution of the LennonMcCartney partnership, John Lennon particularly now showing interest in composing songs of a more autobiographical nature. "I\'m a Loser" shows Lennon for the first time coming under the influence of Bob Dylan, whom he met in New York while on tour, on 28 August 1964.\nBeatles for Sale did not produce a single for the UK  the non-album tracks "I Feel Fine" and "She\'s a Woman" performed that role. Nevertheless, that coupling was followed up in the United States by "Eight Days a Week", which became their seventh number one in March 1965.\nThe album hit the UK number one spot and retained that position for 11 of the 46 weeks that it spent in the Top 20. Beatles for Sale did not surface as a regular album in the US until 1987. In its place was Beatles \'65 which featured eight songs from Beatles for Sale, plus the A and B-side of "I Feel Fine" and "I\'ll Be Back" from the UK\'s A Hard Day\'s Night album. Beatles \'65 enjoyed a nine-week run at the top of the US charts beginning in January 1965.',
  strDescriptionDE: null,
  strDescriptionFR: "Beatles for Sale est le quatrime album des Beatles, paru le 4 dcembre 1964 au Royaume-Uni. Il est conu alors que la Beatlemania bat son plein, dans la foule de la sortie de l'album A Hard Day's Night. Selon la volont du manager Brian Epstein et du producteur George Martin, le groupe doit,  cette poque, respecter un rythme de deux albums par an, celui-ci devant paratre  temps pour les ftes de fin d'anne. Il est donc rapidement enregistr aux studios EMI, en sept journes de travail parpilles entre aot et octobre 1964.\n\nLes Beatles ont alors acquis une popularit plantaire, ils sont harasss par les tournes internationales, les concerts quasi quotidiens et la folie qui les entoure, ce qui se reflte notamment dans la pochette et les thmes sombres de leurs chansons.\n\nAlors que toutes les chansons de A Hard Day's Night taient signes Lennon/McCartney, Beatles for Sale est marqu par le retour des reprises de rock 'n' roll. Presss par le temps, littralement pousss vers les studios, les Fab Four enregistrent ici ce qui constitue leur rpertoire de scne du moment, incluant six reprises et huit chansons originales, nouvellement composes ou plus anciennes. L'album innove cependant dans plusieurs sens, avec des chansons plus personnelles de la part de John Lennon, et le recours plus frquent  des techniques de studio pour peaufiner les enregistrements.\n\nEn Grande-Bretagne, Beatles for Sale passe sept semaines en premire place des hit-parades, dlogeant A Hard Day's Night du sommet, et reste quarante-six semaines en tout dans les classements. Il ne parat pas sous cette forme aux tats-Unis : onze jours aprs la version britannique, il est dit par Capitol Records avec une pochette, une liste de chansons et un nom diffrents, Beatles '65. De plus, certains titres n'apparaissent que sur l'album suivant, Beatles VI. Ce qui n'empchera pas les deux albums, sortis  un mois d'intervalle, de rester  la premire place du Billboard, pendant plusieurs semaines de suite.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "Beatles for Sale fue el cuarto lbum de estudio britnico grabado por The Beatles, publicado el 4 de diciembre de 1964 por la compaa discogrfica Parlophone, con el nmero de catlogo PMC 1240 (mono) y PCS 3062 (estreo).\n\nCon un pedido de ms de 700 000 discos antes de su publicacin, se clasific enseguida en el nmero uno de la lista britnica, y desbanc de la misma a su lbum predecesor, A Hard Day's Night. Estuvo en ese puesto durante siete semanas, aunque el 27 de febrero de 1965, despus de haber bajado tres semanas antes de ese primer puesto, habra de volver a l durante una semana ms. El 1 de mayo de 1965 aun volvera a subir otra vez a la cima de la lista, despus de faltar ocho semanas en ese primer puesto, esta vez para permanecer en esa posicin durante tres semanas ms, y sumo as un total de once semanas en el primer puesto de la lista britnica, de las cuarenta y seis que pas en ella. Este lbum marc un momento decisivo en la evolucin de Lennon y McCartney como letristas, particularmente en Lennon, que estaba cada vez ms interesado en componer canciones de naturaleza autobiogrfica.",
  strDescriptionPT: 'Beatles for Sale  o quarto lbum do The Beatles, lanado em dezembro de 1964.\n\nQuando do lanamento de "Beatles For Sale", a beatlemania estava a todo vapor e o sucesso do filme/lbum "A Hard Day\'s Night" havia trazido o reconhecimento de pblico e crtica. Neste disco os Beatles repetiram a frmula "Covers" (dentre os quais a releitura definitiva de "Rock And Roll Music" de Chuck Berry) e composies prprias, onde destacam-se "Eight Days A Week" e "No Reply".',
