  strDescriptionEN: 'Anthology 1 is a compilation album by The Beatles, released by Apple Records in November 1995. It was released as the first part of the Anthology trilogy of albums with Anthology 2 and Anthology 3, all of which tie-in with the televised special The Beatles Anthology. It contains "Free as a Bird", billed as the first new Beatles song in 25 years. The album topped the Billboard 200 album chart and was certified 8x Platinum by the RIAA. The Anthology albums were made available on the iTunes Store on 14 June 2011.',
  strDescriptionDE: null,
  strDescriptionFR: "Anthology 1 est le premier des trois volumes de la srie de compilations Anthology des Beatles, paru le 21 novembre 1995 des deux cts de lAtlantique. Il se compose principalement denregistrements rares et indits du groupe.\n\nLes titres qui se retrouvent sur cette compilation datent de 1958  1964, depuis lpoque des Quarrymen jusqu la prparation de lalbum Beatles for Sale fin 1964. Elle retrace en passant la fameuse audition rate chez Decca, et de nombreux extraits parls des membres du groupe et de leurs proches. Ce premier volume Anthology contient une  nouvelle  chanson : Free as a Bird. Cette chanson a t retrouve sur des enregistrements effectus par John Lennon en 1977, non exploits, et que les Beatles survivants ont termin lors de leur runion en 1994. Elle devint ainsi la premire nouveaut des Beatles  paratre, 25 ans aprs la sparation du groupe. Une autre chanson est retravaille pour lalbum suivant : Real Love.\n\nLa compilation rencontre un important succs commercial, dont trois millions de copies sont vendues en seulement six semaines sur le march amricain, fait remarquable pour un groupe  lpoque dissout depuis 25 ans.\n\nAnthology 1 prsente un intrt historique pour les fans, du fait quil contient, entre autres, les performances des ex-Beatles Pete Best   la batterie  et Stuart Sutcliffe   la basse. On peut entendre Sutcliffe sur trois pistes : Hallelujah, I Love Her So, You'll Be Mine, et Cayenne, et Best  qui fut dbarqu du groupe mi-aot 1962 peu aprs la premire audition chez EMI  sur les pistes 10  12, 15  19, 21 et 22 du premier disque. C'est donc lui que l'on entend sur la version de Love Me Do prsente dans cette compilation.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "Anthology 1 es un lbum recopilatorio del grupo de rock britnico The Beatles, publicado en 1995. Supone el primer volumen de tres lbumes con rarezas y tomas alternativas de canciones grabadas entre 1958 y 1964, incluyendo grabaciones caseras registradas durante la existencia de The Quarrymen y la audicin de Decca Records. Asimismo, el lbum incluye Free as a Bird, el primer tema nuevo del grupo en veinticinco aos.",
  strDescriptionPT: "The Beatles Anthology 1  um lbum em CD duplo lanado em novembro de 1995 com entrevistas, gravaes alternativas, algumas raras, outras como ensaios, outras no aproveitadas, executadas pelos integrantes dos Beatles, juntos ou individualmente. Cobre os primrdios da formao do grupo, incluindo gravaes com antigos msicos que participaram de sua trajetria; Stuart Sutcliffe e Pete Best, por exemplo. Dentre os trs lanamentos da srie Anthology,  o nico que contm entrevistas. Dura 14533. Inclui a cano Free as a Bird, gravada e produzida em 1994, a partir de uma fita demo de John Lennon de 1977.",
