  strDescriptionEN: 'Anthology 2 is a compilation album by The Beatles, released by Apple Records in March 1996. It is the second of the three-volume Anthology collection, all of which tie-in with the televised special The Beatles Anthology. The opening track is "Real Love", the second of the two recordings that reunited the Beatles by means of magnetic tape. Like its predecessor, the album topped the Billboard 200 album chart, and has been certified 4 Platinum by the RIAA. The Anthology albums were made available on the iTunes Store on 14 June 2011.',
  strDescriptionDE: null,
  strDescriptionFR: "Anthology 2 est une compilation des Beatles sortie en mars 1996 dans le cadre de la collection The Beatles Anthology.\n\nCet album contient des enregistrements rares, parfois effectus en concerts, et des prises alternatives provenant de diverses sessions aux studios Abbey Road, depuis celles de l'album Help! au printemps 1965, jusqu'au titres enregistrs dbut 1968 avant le dpart du groupe pour l'Inde. Il contient aussi la seconde  nouvelle chanson  des Beatles, Real Love, compose par John Lennon et rarrange par le groupe.\n\n l'instar du prcdent volume de la collection, Anthology 2 obtint un succs considrable au moment de sa sortie. Il a mme atteint la premire place des charts anglais durant une semaine.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "Anthology 2 es un lbum recopilatorio del grupo de rock britnico The Beatles, publicado en 1996 como parte de la serie The Beatles Anthology.\n\nEl lbum incluye rarezas, temas en directo y tomas alternativas registradas durante las sesiones de grabacin de Help! hasta poco antes del viaje del grupo a la India en febrero de 1968.\n\nEl lbum incluye Real Love, segundo nuevo trabajo del grupo sobre una demo grabada por John Lennon y dada a Paul McCartney por la viuda de aqul, Yoko Ono, para que el resto de la banda la terminase de grabar. A diferencia de Free as a Bird, indita hasta 1995 con la excepcin de entre determinados crculos de coleccionistas, Real Love haba aparecido previamente en el documental Imagine: John Lennon y en su correspondiente banda sonora.",
  strDescriptionPT: 'The Beatles Anthology 2  um CD duplo lanado em maro de 1996 com gravaes alternativas, algumas raras, outras como ensaios, outras no aproveitadas, executadas pelos integrantes dos Beatles, juntos ou individualmente. Cobre o perodo que vai de 1965 at 1968. Coincide com o incio das sesses das gravaes para o lbum Help! e se estende at as msicas gravadas nas felizes sesses de fevereiro de 1968, antes de viagem para a ndia. Inclui tambm a cano "Real Love" gravada e produzida em 1995 a partir de uma fita demo de John Lennon, tal qual fizeram com "Free as a Bird, lanada no CD anterior, Anthology 1". Dura 127\'54" .',
