  strAlbum3DThumb: null,
  strDescriptionEN: 'Anthology 3 is a compilation album by The Beatles released in October 1996 by Apple Records as part of The Beatles Anthology series. The album includes rarities and alternative tracks from the final two years of the band\'s career, ranging from the initial sessions for The Beatles (also known as The White Album) to the last sessions for Let It Be and Abbey Road in later 1969 and early 1970.\nFollowing "Free as a Bird" in Anthology 1 and "Real Love" in Anthology 2, a third John Lennon solo demo entitled "Now and Then" was to be reworked by the three surviving members of The Beatles for Anthology 3. However, it was decided against due to complications and sound quality issues involving Lennon\'s recording. In its place is "A Beginning", an orchestral instrumental track initially intended for The White Album. "A Beginning" was composed by producer George Martin and intended to be the intro track to the Ringo Starr penned "Don\'t Pass Me By".\nSimilar to the previous Anthology albums, the cover image painted by Klaus Voorman features a collage of The Beatles-related imagery designed to appear as a wall of peeling posters and album covers. An updated picture of Voorman can be seen in George Harrison\'s hair in a segment of the Revolver album cover.\nThe album was certified 3x Platinum by the RIAA, and was the group\'s third double album in a row to reach #1 on the US charts, equalling a record set by Donna Summer back in the 1970s.\nThe Anthology albums were made available on the iTunes Store on 14 June 2011.',
  strDescriptionDE: null,
  strDescriptionFR: "Anthology 3 est une compilation sortie en novembre 1996 dans le cadre de la collection The Beatles Anthology. Il contient des enregistrements rares et des versions alternatives des chansons des Beatles, depuis les sessions initiales de lAlbum Blanc, jusqu'aux dernires de Abbey Road.",
