  strDescriptionES: 'Anthology 3 es un lbum recopilatorio del grupo de rock britnico The Beatles, publicado en 1996 como parte de la serie The Beatles Anthology. El lbum incluye rarezas, interpretaciones en directo y tomas alternativas desarrolladas en las sesiones de grabacin que van desde el lbum Blanco hasta las ltimas reuniones del grupo para los lbumes Let It Be y Abbey Road.\n\nUna tercer demo de John Lennon, titulado "Now and Then", fue ampliado en el estudio por Paul McCartney, George Harrison y Ringo Starr en un intento por incluirla en Anthology 3, si bien sera finalmente descartada debido a un ruido de fondo que no poda ser eliminado con las tcnicas de estudio. En su reemplazo, fue aadida A Beginning compuesta por George Martin.',
  strDescriptionPT: "Anthology 3  um lbum duplo lanado em outubro de 1996 pelos The Beatles com gravaes alternativas, algumas raras, outras como ensaios, outras no aproveitadas, executadas pelos integrantes dos Beatles, juntos ou individualmente. Cobre o perodo que vai de 1968 at 1969. Coincide com o incio das sesses das gravaes para o lbum The Beatles (conhecido como O lbum Branco), e abrange tambm o perodo das gravaes das msicas dos lbuns Let It Be e Abbey Road. Dura 14533.",
