  strAlbum3DFace: null,
  strAlbum3DThumb: null,
  strDescriptionEN: 'Love is a soundtrack remix album of music recorded by The Beatles, released in November 2006. It features music compiled and remixed as a mashup for the Cirque du Soleil show of the same name. The album was produced by George Martin and his son Giles Martin, who said, "What people will be hearing on the album is a new experience, a way of re-living the whole Beatles musical lifespan in a very condensed period."',
  strDescriptionDE: null,
  strDescriptionFR: "Love est un album sorti en novembre 2006 contenant de la musique compile et remixe des Beatles. George Martin et son fils, Giles Martin, l'ont produit en collaboration avec le Cirque du Soleil  partir de la trame sonore ralis pour le spectacle Love, jou sur la scne du  Mirage   Las Vegas.\n\nPour crer cet album, George et Giles Martin ont seulement utilis les enregistrements originaux   l'exception d'une nouvelle orchestration compose par George pour la chanson While My Guitar Gently Weeps  mais l'ont prsent d'une manire entirement diffrente.  Ce que les gens vont entendre sur l'album est une nouvelle exprience, un moyen de revivre la vie musicale des Beatles entire dans un espace de temps trs condens  a dit Giles. Les producteurs utilisent ici, mais pas sur tous les titres, la technique dite du mashup, c'est--dire le fait de mler plusieurs titres, plusieurs pistes de provenances diverses, au sein de la mme chanson...",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: 'Love es un lbum, ganador del premio Grammy, que contiene un remix de los temas ms conocidos de The Beatles y es la banda sonora del show del Cirque du Soleil con el mismo nombre. Fue publicado el 20 de noviembre de 2006 y producido por Sir George Martin, y su hijo Giles.\n\nA George Harrison le gustaba el circo canadiense "Cirque du Soleil"; en vida mantuvo una buena relacin personal y profesional con el fundador del espectculo, Guy Laliberte. Antes de morir lleg a un acuerdo con el resto de Los Beatles, Paul McCartney y Ringo Starr, adems de Yko Ono, para montar un show para el circo en que el centro no fuera la vida de Los Beatles sino los abigarrados personajes que los msicos crearon a lo largo de su discografa.\n\nPara este proyecto la empresa Apple, junto a Cirque du Soleil, encargaron a Sir George Martn retomar el papel de productor. Posteriormente se incorpor la empresa Mirage, de Las Vegas, a fn de realizar la primera presentacin de Love, durante 2006. El deseo original era hacerlo en Londres o Nueva York, pero no fue posible.\n\nEl proyecto Love tom 2 aos, en que George Martin trabaj junto a su hijo Giles como ingenieros de sonido, y en el se utiliz nicamente material original de Los Beatles. Este proyecto sera la primera grabacin de Los Beatles realizada originalmente con la tecnologa DTS 5.1. Sera tambin la primera incursin de los Beatles en el teatro, medio que siempre interes a los msicos, pero en el que nunca pudieron trabajar.\n\nPara el mezclado y edicin se utilizaron similares tcnicas que emple el quinteto (Lennon, Harrison, Starr, McCartney y Martin) en su creaciones, actualizadas con los medios actuales. Ejemplo de esto es el tema "Gnik Nus" que es el tema "Sun King" del lbum Abbey Road tocado al revs.\n\nCada tema ha sido mezclado incorporando partes de otros temas; en algunos se han doblado pasajes a fin de crear algn ambiente o atmsfera, en otros se han ralentizado o acelerado las voces, tambin se encuentran trozos que se alargan en el tiempo, en especial las transiciones entre un tema y otro, parte necesaria en presentaciones en vivo en que se pasa de una temtica a otra y es necesario cambiar los escenarios.\n\nLa versin en 5 canales DTS permite apreciar matices que se pierden en las mezclas de 2 canales o stereo.',
  strDescriptionPT: "Love  um lbum dos Beatles lanado em Novembro de 2006. Produzido por George Martin e seu filho Giles Martin,  uma coletnea de msicas remixadas, criadas especialmente para o show LOVE do Cirque du Soleil.\n\nAmantes de corridas de carros, George Harrison e Guy Lalibert, fundador e dono do Cirque du Soleil, tornaram-se grande amigos. George, ento, planejava criar um espetculo em parceria com o grupo de artes circenses. Com a sua morte em 29 de novembro de 2001, o projeto foi suspenso temporariamente. Mais tarde, aps amplas negociaes entre as partes envolvidas, Guy Lalibert entregou a misso de criar um espetculo baseado nas msicas dos Beatles a um de seus diretores e coregrafos, Dominic Champagne. O show teria por nome Love. Restava criar a trilha sonora, com as msicas do quarteto. A escolha para a misso recaiu em George Martin, que havia trabalhado como produtor dos Beatles na maior parte de suas criaes. Para montar essa mistura sonora, George Martin chamou o seu filho Giles Martin para auxilia-lo na tarefa. Com a aprovao de Paul McCartney, Ringo Starr, Yoko Ono (herdeira de John Lennon) e Olvia Harrison (herdeira de George Harrison), os dois levaram dois anos misturando e mesclando as msicas, em cima das fitas master existentes.",
