  strDescriptionEN: "Introducing... The Beatles is the first Beatles album released in the United States. Originally scheduled for a July 1963 release, the LP came out on 10 January 1964, on Vee-Jay Records, ten days before Capitol's Meet the Beatles!. It was the subject of much legal wrangling, but ultimately, Vee-Jay were permitted to sell the album until late 1964, by which time it had sold more than 1.3 million copies.",
  strDescriptionDE: null,
  strDescriptionFR: "Introducing... The Beatles est un album du groupe britannique The Beatles, le premier publi aux tats-Unis. Initialement prvu pour paratre en juillet 1963, il n'est publi que le 10 janvier 1964, par Vee-Jay Records, quelques jours avant le Meet The Beatles! de Capitol. Introducing... The Beatles a t l'objet de nombreux contentieux entre les deux labels, mais Vee-Jay a finalement t autoris  le vendre jusque mi-octobre 1964, en coulant ainsi plus d'un million d'exemplaires.\n\nIntroducing... The Beatles est la premire version amricaine de Please Please Me, le premier album britannique des Beatles.",
