  strDescriptionES: "Introducing... The Beatles es el primer lbum norteamericano de The Beatles. Originalmente previsto para ser lanzado en julio de 1963, el LP sali finalmente el 10 de enero de 1964, publicado por Vee-Jay Records das antes de que lo hiciera Capitol Records con su lbum Meet The Beatles!. Fue objeto de una discusin legal, aunque despus, se le permiti a Vee-Jay vender el lbum hasta finales de 1964. Para entonces, el disco vendi ms de 1.3 millones de copias.",
