  strDescriptionEN: "Meet the Beatles! is the first Beatles' album to be issued in the United States by Capitol Records. Released on 20 January 1964, in both mono and stereo formats, it topped the popular album chart on 15 February 1964 and remained at number one for an impressive eleven weeks. It was then supplanted by The Beatles' Second Album, the first time that an act had replaced itself at the peak album position. The cover featured Robert Freeman's portrait used for the UK With the Beatles release, with a blue tint added to the original stark black-and-white photograph.",
  strDescriptionDE: null,
  strDescriptionFR: "Meet The Beatles! est le deuxime album amricain des Beatles, sorti en 1964 et le premier sur l'tiquette Capitol, proprit de EMI. Il reprend une partie du contenu du deuxime album britannique du groupe, With the Beatles, et y ajoute trois titres tirs de singles. Les titres de With the Beatles absents de cet album apparaissent aux tats-Unis sur l'album suivant du groupe, The Beatles' Second Album.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "Meet the Beatles! es un lbum del grupo ingls The Beatles publicado en Estados Unidos el 20 de enero de 1964. Fue el primer lbum del grupo editado en aquel pas por el sello Capitol Records, antes de que The Beatles viajaran por primera vez a Norteamrica.\n\nLa portada del disco ofreca la misma foto en blanco y negro de Robert Freeman que la que mostraba el segundo lbum oficial del grupo editado en el Reino Unido, titulado With the Beatles. Su contraportada presentaba una descripcin general de los Beatles y la locura que representaba entre sus fans la mera presencia de ellos en los diferentes sitios donde actuaban.\n\nEn 2003, el lbum fue clasificado en el nmero 59 por la revista Rolling Stone en su lista de los 500 mejores lbumes de todos los tiempos.",
