  strDescriptionEN: "Beatles '65 is the Beatles' fifth Capitol release, but seventh American album. It was released in mono and stereo versions. The album was also issued in Germany on the Odeon label.\n\nOn 16 November 2004, this album was released on Compact Disc for the first time as part of The Capitol Albums, Volume 1 box set.\n\nIn the US the album was a blockbuster hit, and jumped from number 98 straight to number one, making the biggest jump to the top position in the history of the Billboard Album Charts up to that time. It remained at number one for nine straight weeks, starting on 9 January 1965. In what may be testament to the overwhelming market appeal of the Beatles, several albums were released and promoted in America during 1965 sporting a similar title. These included Sinatra '65 by Frank Sinatra and Ellington '65 by Duke Ellington on Reprise Records, Trio '65 by jazz pianist Bill Evans on Verve Records, and Brasil '65 by Srgio Mendes on the Beatles' own Capitol label.",
  strDescriptionDE: null,
  strDescriptionFR: "Beatles '65 est un album des Beatles, le 6e publi aux tats-Unis par Capitol Records. Onze jours aprs la sortie de Beatles For Sale sur le label Parlophone au Royaume-Uni, il en reprend neuf titres (sur 14), complts par I Feel Fine (publi en single de l'autre ct de l'Atlantique), et I'll Be Back, paru prcdemment sur l'dition britannique de l'album A Hard Day's Night.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "Beatles '65 es un lbum de estudio de la banda britnica The Beatles. Fue editado en especial para el mercado estadounidense en 1964. Era el quinto lbum lanzado por Capitol Records, pero sexto contando con el primero lanzado por Vee-Jay Records.\n\nEl lbum se convirti en un gran xito en los Estados Unidos, saltando directamente del n. 98 al n. 1, haciendo el mayor salto a la posicin de privilegio en la historia de las listas Billboard hasta ese momento. En lo que puede ser testimonio del abrumador atractivo que supusieron los Beatles para el mercado estadounidense, varios lbumes fueron publicados y promovidos en aquel pas durante 1965 luciendo un ttulo similar. Entre ellos estaban Sinatra '65, de Frank Sinatra, y Ellington '65, de Duke Ellington, por el sello Reprise Records; Trio '65, del pianista de jazz Bill Evans, por el sello Verve Records; y Brasil '65, de Srgio Mendes, editado en la propia etiqueta americana de los Beatles, Capitol Records.\n\nEn 2004, este lbum fue lanzado por primera vez en CD en The Capitol Albums Vol. 1, que contena asimismo los discos Meet the Beatles!, The Beatles' Second Album y Something New.",
