  strDescriptionEN: "Beatles VI is the Beatles' seventh Capitol Records release in the United States (including The Beatles' Story). It was the ninth album released into that market in less than one and a half years (Vee-Jay Records and United Artists Records also released one album each during that period). The LP was released in both mono and stereo versions.\n\n\"Beatles VI\" reached number one in Billboard for six weeks, beginning on 10 July 1965.\n\nThis LP was also released in New Zealand in stereo in time for Christmas 1966. The pressing plates were obtained from EMI (UK) and are identical to their export only release. The title on the record label reads Beatles IV, and the catalogue number is PCSM 6042.\n\nThis album is available on CD as part of The Capitol Albums, Volume 2 box set in both stereo and mono mixes.",
  strDescriptionDE: null,
  strDescriptionFR: "Beatles VI est un album du groupe britannique The Beatles, le 9e publi aux tats-Unis par Capitol Records. Il comprend 6 titres issus de l'dition britannique de Beatles For Sale, 3 en provenance de l'album Help!, Yes It Is (la face B du single Ticket to Ride) et enfin la reprise Bad Boy, une chanson enregistre par les Beatles en mai 1965 uniquement pour le march amricain et donc seulement prsente  l'origine sur ce disque.",
