  strDescriptionES: "Beatles VI es el sexto lbum de The Beatles publicado en Estados Unidos por Capitol Records (sptimo, contando The Beatles' Story). Este fue tambin el noveno lbum publicado en el mercado estadounidense en un espacio de tiempo de un ao y medio (Vee-Jay Records y United Artists Records tambin haban publicado un lbum de la banda cada uno).\n\nEste lbum estuvo disponible tambin en el box set de The Capitol Albums Vol. 2, tanto en su edicin original monofnica como estereofnica.",
