  strAlbum3DThumb: null,
  strDescriptionEN: 'Yesterday and Today (rendered as "Yesterday" ...and Today on the record label and in most published discographies) is the ninth Capitol album release by the Beatles and the eleventh overall American release. It was issued only in the United States, Canada and Japan (in the 1970s). The album is remembered primarily for the controversy surrounding its original cover image, the "butcher cover" featuring the band dressed in white smocks and covered with decapitated baby dolls and pieces of meat. The album\'s title is based on the song "Yesterday." Early album cover proofs show the word "Yesterday" in quotes.',
  strDescriptionDE: null,
  strDescriptionFR: "Yesterday and Today est le dixime album amricain des Beatles, publi le 20 juin 1966 par Capitol Records. Dans l'enchanement des publications amricaines du groupe rpondant au format standard dans ce pays et qui n'acceptent donc pas les 14 titres en moyenne publis sur les ditions originales britanniques, Capitol rcupre ainsi des morceaux publis en 1965 et 1966 sur les albums Help!, Rubber Soul et Revolver. Le titre que porte le disque souligne ses particularits. Yesterday, le hit de Paul McCartney, qui permet au label de le publier sur un de ses albums, et Today pour les trois chansons issues de Revolver qui ne sort que deux semaines plus tard en Grande-Bretagne. Y figure aussi le single Day Tripper/We Can Work It Out commercialis au Royaume-Uni le 3 dcembre 1965, en mme temps que Rubber Soul.\n\nLe sentiment qu'prouvent les Beatles vis  vis du traitement amricain de leurs uvres se traduit bien dans la pose qu'ils prennent en blouses de bouchers, entours de viande et de poupes dcapites, pour l'phmre pochette de cet album, rapidement retire du commerce et remplace par une autre illustration. C'est le dernier album sur lequel Capitol chamboule totalement les contenus des versions originales britanniques.\n\nYesterday and Today est donc le dernier disque cr par Capitol exclusivement pour le march nord-amricain. L'album Hey Jude, paru en 1970, qui regroupe en majorit des singles, sera publi par Apple Records. Par contre la maison d'dition crera en 1967 le 33 tours Magical Mystery Tour en rajoutant au double maxi britannique les singles parus la mme anne.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: 'Yesterday and Today es el noveno lbum de The Beatles lanzado por Capitol Records para el mercado de los Estados Unidos en junio de 1966. Este lbum es recordado especialmente por la controversia que gener la famosa portada del "carnicero", donde apareca la banda vestidos con delantales blancos, y rodeados de muecas descabezadas y de pedazos de carne, la cual fue censurada por la discogrfica americana. El ttulo del lbum haca mencin a la cancin "Yesterday". Cinco das despus de haberse editado, el lbum apareci con una nueva portada en la cual los Beatles posaban simplemente al lado de un bal.',
