  strDescriptionEN: '19621966 (widely known as "The Red Album") is a compilation of songs by the English rock band The Beatles, spanning the years indicated in the title. It was released with its counterpart 19671970 ("The Blue Album") in 1973. 19621966 reached number 3 in the United Kingdom and managed to reach number 1 in the United States Cashbox albums chart. However, in the US, the official chart was administered by Billboard, where 19621966 peaked at number 3, while 19671970 reached the top spot. This album was re-released in September 1993 on compact disc, charting at number 3 in the UK.\n\nThe album was compiled by Beatles manager Allen Klein. Even though the group had had success with cover versions of songs, most notably with "Twist and Shout", which made number 2 on the Billboard charts, only songs composed by the Beatles themselves were included.\n\nAs with 19671970, this compilation was produced by Apple/EMI at least partially in response to a bootleg collection titled Alpha Omega, which had been sold on television the previous year. Print advertising for the two records made a point of declaring them "the only authorized collection of the Beatles.',
  strDescriptionDE: null,
  strDescriptionFR: "1962-1966  aussi connu sous le surnom The Red Album (l'album rouge)  est une compilation rassemblant 26 des plus grands succs des Beatles publis entre 1962 et 1966. Originalement sorti en 1973, il est publi pour la premire fois sur CD le 20 septembre 1993 tandis qu'une version remastrise est publie en 2010. L'album est un grand succs commercial.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "The Beatles/1962-1966, conocido como Red Album (lbum Rojo), es una compilacin de las canciones del grupo de rock britnico The Beatles desde 1962 hasta 1966, que fue lanzado junto con el lbum The Beatles/1967-1970 (tambin llamado lbum Azul).\n\nLa versin en CD fue lanzada en dos discos, hubindose podido editar en uno slo por su duracin. EMI explic que esto era as para poder hacer juego con la salida de su hermano The Beatles/1967-1970.\n\nEs uno de los seis lbumes certificados con disco de diamante de The Beatles, lo que los convierte en los mximos ganadores de este reconocimiento en la historia de la msica. Los otros lbumes con disco de diamante son The Beatles/1967-1970, The Beatles, Abbey Road, Sgt. Pepper's Lonely Hearts Club Band y 1.",
  strDescriptionPT: "The Beatles 1962-1966 (tambm conhecido como o lbum vermelho)  uma coletnea do grupo de rock ingls The Beatles, lanada em 1973. Rene 26 msicas gravadas no estdio da apple. A coletnea contm msicas gravadas entre 1962 e 1966.",
