  strDescriptionEN: '19671970 (widely known as "The Blue Album") is a compilation of songs by the English rock band The Beatles, spanning the years indicated in the title. It was released with 19621966 ("The Red Album"), in 1973. 19671970 made number 1 on the American Billboard chart and number 2 on the British Album Chart. This album was re-released in September 1993 on compact disc, charting at number 4 in the United Kingdom.\n\nThe album was compiled by Beatles manager Allen Klein. Songs performed by the Beatles as solo artists were also considered for inclusion, but like the cover songs on 19621966, limited space resulted in this idea having to be abandoned.\n\nAs with 19621966, this compilation was produced by Apple/EMI at least partially in response to a bootleg collection titled Alpha Omega, which had been sold on television the previous year. Print advertising for the two records made a point of declaring them "the only authorized collection of the Beatles.',
  strDescriptionDE: null,
  strDescriptionFR: "The Beatles 1967-1970  aussi connu sous le surnom The Blue Album ( l'album bleu )  est une compilation rassemblant 28 des plus grands succs du groupe rock britannique The Beatles publis entre 1967 et 1970. Originalement sorti en 1973, il est publi pour la premire fois sur CD le 20 septembre 1993 tandis qu'une version remastrise a t publie en 2010. L'album est un grand succs commercial.",
