  strDescriptionES: "The Beatles/1967-1970, tambin conocido como The Blue Album El lbum azul, es un lbum recopilatorio de la banda de rock britnica The Beatles, que abarca las canciones ms populares desde 1967 a 1970. La compaa discogrfica Apple Records public el lbum el 19 de abril de 1973 en el Reino Unido. El material ocup el puesto nmero uno en los Estados Unidos, mientras que en el Reino Unido, el dos. Es uno de los seis lbumes certificados con disco de diamante de The Beatles, lo que los convierte en los mximos ganadores de este reconocimiento en la historia de la msica. Los otros lbumes con disco de diamante son The Beatles/1962-1966, The Beatles, Abbey Road, Sgt. Pepper's Lonely Hearts Club Band y 1. The Beatles, ya separados, participaron en la seleccin de canciones, fotos y en el color del lbum.",
