  strAlbum3DFace: null,
  strAlbum3DThumb: null,
  strDescriptionEN: "Live at the BBC is a 1994 compilation album featuring performances by The Beatles that were originally broadcast on various BBC Light Programme radio shows from 1963 through 1965. The mono album, available in multiple formats but most commonly as a two-CD set, consists of 56 songs and 13 tracks of dialogue; 30 of the songs had never been issued previously by The Beatles. It was the first official release by The Beatles of previously unissued performances since The Beatles at the Hollywood Bowl in 1977, and the first containing previously unreleased songs since Let It Be in 1970.\n\nAlthough the songs were recorded ahead of broadcast, allowing for retakes and occasional overdubbing, they are essentially \"live in studio\" performances. Most of the songs are cover versions of material from the late 1950s and early 1960s, reflecting the stage set they developed before Beatlemania. Before the album's release, comprehensive collections of The Beatles' BBC performances had become available on bootlegs.",
  strDescriptionDE: null,
  strDescriptionFR: "Publie en CD en 1994, Live at the BBC est une compilation de chansons enregistres live par les Beatles entre 1963 et 1965 dans les studios de la BBC. Pour beaucoup, il s'agit de reprises de standards du rock 'n' roll et autres tubes du dbut des annes 1960. Elles furent  l'origine diffuses dans les missions de radio Saturday Club, Side by Side, Pop Go The Beatles, Easy Beat, From Us To You, Top Gear et Ticket to Ride.\n\nEntre le 7 mars 1962 et le 7 juin 1965, les Beatles feront en tout 52 apparitions dans les locaux de la prestigieuse radio Londonienne, la British Broadcasting Corporation (BBC), pour y interprter pas moins de 88 chansons diffrentes, enregistres par la BBC.\n\nC'est le 7 mars 1962 que John Lennon, Paul McCartney, George Harrison et Pete Best pntrent pour la premire fois dans les studios de la BBC, dans le cadre de l'mission Teenagers Turn (Here We Go) ou ils interprteront quatre titres, trois reprises qu'ils affectionnent : Dream Baby, Memphis Tennessee et Please Mr. Postman - et une de leur propres compositions : Hello Little Girl.\n\nCes rendez-vous radiophoniques auront pour effet daccrotre toujours plus la popularit du groupe, qui au cours de lanne 1963 devra mme rpondre aux courriers des fans  lantenne, dans une ambiance totalement dcontracte.\n\nCes enregistrements ont t abondamment pirats, donnant naissance entre autres au coffret The Complete BBC Sessions riche d'une dizaine de CD comportant 247 prises.\n\nLa BBC prtendit plus tard n'avoir gard que deux missions des Beatles dans ses archives et effac le reste !\n\nMais les fans des Beatles avaient dj enregistr toutes les apparitions du groupe ds la premire mission du 7 mars 1962. Le travail de la maison de disques EMI et d'Apple fut donc de rcuprer ces diffrents enregistrements qui avaient permis l'dition de 13 albums pirates (The Beatles At The Beeb), puis de slectionner les meilleures qualits sonores possibles des diffrentes prises et de nettoyer ces enregistrements des bruits divers, de les filtrer, puis de les retravailler en numrique.\n\nEn 1994, Les 180 000 exemplaires du premier tirage d'EMI furent vendus instantanment, permettant  cet album d'entrer directement  la premire place des charts britanniques. Aux tats-Unis, Capitol avait prvu une mise en place de 750 000 exemplaires et deux millions d'exemplaires taient dj en prcommande en moins d'un mois. Avant la fin de l'anne 1995, les ventes mondiales de ce double album avait dj franchi le cap des huit millions d'exemplaires.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "Live at the BBC es un lbum de The Beatles publicado en 1994. Esta es una recopilacin de varias presentaciones realizadas por la banda en la BBC entre los aos 1963 y 1965.\n\nMuchas de estas presentaciones han salido a la luz gracias al programa de la BBC Radio 1 The Beeb's Lost Beatles Tapes de 1988. Contiene varias canciones inditas y versiones que la banda interpretaba en sus primeros das.",
  strDescriptionPT: "Live at the BBC  um lbum do grupo de rock ingls The Beatles. Lanado em 1994, o lbum possui diversas gravaes feitas para programas de rdio da BBC entre 1963 e 1965.\n\nEntre 1962 e 1965, os Beatles realizaram diversas apresentaes na BBC de Londres. Diversas apresentaes esto registradas no lbum Live at BBC lanado em 1994. Foi o primeiro lbum dos Beatles com msicas inditas desde Let it Be de 1970.\n\nEntre Maro de 1962 e Junho de 1965, os Beatles se apresentaram cinqenta e duas vezes em programas de rdio, cantando 88 diferentes msicas, e 36 que nunca foram colocadas em um lbum.\n\nO disco mostra o conjunto de rock mais popular da histria em seus primeiros anos e alm de conter velhos clssicos da banda como I Saw her Standing There , Things We Said Today, A Hard Day's Night, I Feel Fine, possui diversos covers de artistas que os Beatles admiravam como Elvis Presley, Chuck Berry, Little Richard, Carl Perkins entre outros. Entre as msicas de outros artistas tocadas pelos Beatles esto Johnny B. Goode de Chuck Berry, A Shot of Rithyim and Blues de Arthur Alexander, Long Tall Sally de Little Richard, entre outros.\n\nAlm disso, o lbum contm alguns dilogos entre a banda e diversos apresentadores como Brian Matthew e mostra vrios momentos de descontrao. O disco obteve um grande sucesso de vendas e de crtica.",
