  strDescriptionEN: "The Beatles at the Hollywood Bowl is a live album released in May 1977 featuring songs by The Beatles compiled from two live performances at the Hollywood Bowl during August 1964 and August 1965. The album was released by Capitol Records in the United States and Canada and on Parlophone in the United Kingdom.\n\nIn New Zealand it was to be pressed and released locally with the catalogue number PCS 6130 (the 6000 series was designated for EMI (NZ) only releases), but this did not occur. Instead New Zealand pressed this record and used the Australian catalogue number PCSO 7577. The album has never been officially released on CD.",
  strDescriptionDE: null,
  strDescriptionFR: "The Beatles at the Hollywood Bowl est le premier album live officiel des Beatles, publi le 4 mai 1977 aux tats-Unis, et deux jours plus tard au Royaume-Uni. Paru sept ans aprs la sparation du groupe, il avait t enregistr lors des tournes amricaines de 1964 et de 1965 des Fab Four (en fait, des concerts au Hollywood Bowl de Los Angeles donns  une anne d'cart), dans l'optique d'un disque pour le march amricain.\n\nLes bandes, satures par les hurlements du public, ont dans un premier temps t dlaisses pour leur pitre qualit. En 1977, Capitol Records demande au producteur George Martin de nettoyer les pistes pour produire un disque de bonne qualit. Le rsultat est publi dans le monde entier, et si les anciens membres du groupe, non sollicits, se montrent dus par le disque, il se classe nanmoins en tte des hit-parades britanniques et connat un bon succs.\n\nMalgr une qualit altre par les cris du public, le disque est considr comme un prcieux tmoignage des prestations des Beatles en concert, aucun album live n'ayant t publi par le groupe durant son existence. Rdit dans une dition bon march en 1984, il n'a par la suite jamais t publi officiellement sur CD.",
  strDescriptionCN: null,
  strDescriptionIT: null,
  strDescriptionJP: null,
  strDescriptionRU: null,
  strDescriptionES: "The Beatles at the Hollywood Bowl es un disco doble que contiene una seleccin grabada en directo de las canciones interpretadas por The Beatles en los conciertos ofrecidos en el Hollywood Bowl el 23 de agosto de 1964 y el 29 de agosto de 1965. El lbum se public por Capitol para Estados Unidos y para Inglaterra por Parlophone, como disco de larga duracin en vinilo.\n\nLa grabacin de los dos conciertos la realiz EMI, ya que George Martin quera lanzar un lbum en directo de The Beatles, pero los gritos de las fans eran tan fuertes que las cintas eran inaudibles; el lbum se edit finalmente en 1976, cuando la tecnologa permiti una produccin adecuada.",
  strDescriptionPT: "The Beatles at Hollywood Bowl  um lbum pstumo de msica lanado pelo grupo de rock ingls The Beatles em 1977. O lbum traz msicas gravadas ao vivo no Hollywood Bowl em Los Angeles durante a tourn de 1964 e 1965. Lanado em vinil, o lbum no foi relanado em cd.",
