  strDescriptionFR: "Hey Jude (titre original : The Beatles Again) est une compilation de singles et de faces B des Beatles, publie en 1970.\n\nLe disque Sgt. Pepper's Lonely Hearts Club Band, est le premier album publi en Amrique par Capitol Records qui sera identique  la version britannique. Prcdemment, le label amricain modifiait la squence des chansons, rajoutaient les pices parues en singles et, surtout, limitaient le nombre de chansons  onze ou douze au lieu de quatorze comme en Angleterre. Rsultat, en 1970, la discographie amricaine comptait 17 albums au lieu des 12 de la discographie maintenant officielle.  partir du moment o les disques taient identiques de part et d'autre de l'Atlantique, plusieurs chansons publies en 45 tours demeuraient  orphelines .\n\nLes singles de l'anne 1967 ont t rajouts aux six chansons de la trame sonore du tlfilm Magical Mystery Tour, commercialise en Angleterre en format double maxi. Cette version 33 tours deviendra,  partir de 1976, le seul disque amricain  devenir un album officiel de la discographie des Beatles.\n\nQuelques mois avant la sortie de Let It Be, Allen Klein, le nouveau manager des Beatles, cra la compilation The Beatles Again qui incorporait plusieurs autres chansons encore introuvables en format long jeu. Tout juste avant sa sortie, le titre fut chang pour capitaliser sur le succs de la chanson Hey Jude1. Ce 33 tours se retrouvera, entre autres, dans les magasins des tats-Unis, du Canada, d'Australie, d'Espagne, d'Allemagne, de France, de Grce, du Japon, du Mexique et de plusieurs pays d'Amerique du Sud. Trs populaire en importation, il sera finalement publi en Angleterre, le 11 mai 1979.\n\nLe disque Hey Jude n'a jamais t dit sur CD. Les deux premires pices, qui avaient dj t publies, en 1964, sur la trame sonore amricaine du film A Hard Day's Night, parue sur l'tiquette United Artists2, se retrouvent dsormais sur le disque du mme nom. Toutes les autres chansons sont maintenant disponibles dans la compilation Past Masters, parue en 1988 et rdite en 2009, qui regroupe toutes les chansons qui n'taient pas prsentes sur les 33-tours britanniques. Les photos de la pochette de l'album, prises au domaine de Lennon  Tittenhurst Parkn 1, issues de la dernire session photo du groupe3, ont t intgres  la pochette intrieure du CD remasteris en 2009 du disque Abbey Road.",
