  strDescriptionES: "Hey Jude (originalmente titulado: The Beatles Again) es un lbum recopilatorio de la banda britnica The Beatles, publicado el 26 de febrero de 1970 por la compaa discogrfica Apple Records. Contiene sencillos inditos en lbumes y varios lados B, as como I Should Have Known Better y Can't Buy Me Love, dos sencillos publicados por Capitol Records cuyas nicas apariciones anteriores en un lbum de Estados Unidos fue en A Hard Day's Night, banda sonora lanzada por United Artists de la pelcula homnima.\n\nLa nueva era digital del CD vio el relanzamiento de los trabajos discogrficos de The Beatles por todo el mundo, aunque para esta ocasin se omiti el recopilatorio Hey Jude. A pesar del relativo xito en las ventas de este lbum, perdi toda su vigencia o posible inters con la salida al mercado de A Hard Days Night y sobre todo, del recopilatorio Past Masters - Volume Two (1988), los cuales contienen en su totalidad las canciones de Hey Jude. Por ese motivo, fue descontinuado y nunca se edit oficialmente en CD desde su original LP y casete.\n\nEs probable que este recopilatorio sea ms recordado por su clebre portada y contraportada, las cuales corresponden a la ltima sesin fotogrfica de la banda (y definitiva con los cuatro miembros). Aunque no trascendi mucha informacin al respecto, se conoce que este hecho tuvo lugar el 22 de agosto de 1969 en la nueva residencia de John Lennon para ese entonces, en Tittenhurst Park, Surrey, Inglaterra. El msico vivi en esa mansin hasta 1972, cuando se mud junto a Yoko Ono a los Estados Unidos.\n\nPoco menos de dos aos despus de las sesiones fotogrficas con The Beatles, Lennon filmara en ese mismo sitio su documental Imagine entre junio y julio de 1971, con las grabaciones de su lbum en solitario del mismo nombre en Ascot Sound Studios.",
