  strDescriptionEN: 'I Saw Her Standing There is a compilation album by the English rock band The Beatles. It is a 2-CD collection of their early recordings, featuring songs from the band\'s Decca Auditions and performances from the Cavern Club, as well as their first ever radio interview. 29 of the 49 of the songs on the album are previously unreleased on any official Beatles album.\n\nDisc 1 is mainly compiled from early performances by The Beat Brothers (an early incarnation of the Beatles) and feature rock and roll singer Tony Sheridan on vocals. Ringo Starr appears only on the last two tracks on disc 2. The album also includes the instrumental track "Cry for a Shadow", the only Beatles composition to be credited to "Harrison/Lennon".',
