  strDescriptionEN: 'On Air  Live at the BBC Volume 2 is a 2013 live/compilation album featuring 63 previously unreleased tracks from the Beatles\' 19631964 BBC Radio broadcasts. It was released on 11 November 2013, along with a remastered and repackaged Live at the BBC Volume 1, which was originally released in 1994. The album is available as a two-CD set and a three-LP set. An exclusive limited edition lithographic print is also available from the Beatles online store. There are several witty and irreverent moments included within the 23 speech tracks. "A Hard Job Writing Them", for example, includes the moment where Ringo describes the trouble he had writing songs for A Hard Day\'s Night and Paul launches the ship "Top Gear" in an unusual voice.',
