  strDescriptionEN: 'Mono Masters was included as part of The Beatles in Mono box set. The premise of this box set was to compile only Beatles material which was released or prepared for release with a dedicated mono mix (the set excludes later material mixed and released only in stereo, and material whose mono version was simply created as an equal mix of the two channels of the stereo version). As a result, the track listing for Mono Masters differs from Past Masters on the second half of disc two, omitting some later songs that never had a mono mix ("Old Brown Shoe", "The Ballad of John and Yoko" and "Let It Be"), and adding several songs released on stereo-only albums that had unreleased mono mixes. Tracks 912 and 15 were prepared in March 1969 for release as a 7" mono Yellow Submarine EP, but due to poor reception of the full album, the project was abandoned. Subsequently, the tracks were only released in stereo (and in an electronically-produced mono mixdown, or "fold-down", of the stereo mix), while the true mono mixes remained unreleased. "Get Back" (with B-side "Don\'t Let Me Down") was the final Beatles single mixed for mono format. It was released in the UK in mono, though the US release was in stereo. Thus, the songs that were originally released on stereo singles in the UK are omitted on this release.',
