  strAlbum3DThumb: null,
  strDescriptionEN: 'Let It Be... Naked is a 2003 album by the English rock group The Beatles. It is a remixed and remastered version of their 1970 album Let It Be. The project was largely initiated by Paul McCartney, who felt that Phil Spector\'s production did not accurately represent the group\'s "stripped-down" intentions for the original album.\n\nLet It Be... Naked presents the songs "naked"  without Spector\'s overdubs and without the incidental studio chatter featured between most cuts of the original album. Let It Be... Naked also replaces "Dig It" and "Maggie Mae" with "Don\'t Let Me Down", originally featured as the B-side of the "Get Back" single.',
