  strDescriptionEN: 'The Beatles Collection is a boxed set of vinyl albums released in the United States in November 1978 and the following month in the United Kingdom containing the official catalogue of The Beatles in stereo, and a new compilation called Rarities. The American issue by Capitol Records contained the British pressings of the same 12 original Beatles albums, with an American pressing of Rarities. The American pressing of Rarities differed from its British counterpart in that it included the previously released English-language versions of "She Loves You" and "I Want to Hold Your Hand," rather than the German-language version found on the British pressing. The American edition of the boxed set was a limited edition of only 3,000 numbered copies. The limited availability of the American release resulted in the British release becoming popular as an import into the US.',
